  "identities.messages.4000010": "Ak\u0254nt no nny\u025B adwuma \u025B. Wo wer\u025B fii s\u025B wob\u025Bhwehw\u025B wo email adresee no mu?",
  "identities.messages.4000011": "Wonni TOTP mfiri a w\u0254ahyehy\u025B.",
  "identities.messages.4000012": "W\u0254de saa nne\u025Bma a w\u0254de sie nsan k\u0254 koodu yi adi dwuma dedaw.",
  "identities.messages.4000013": "Wonni WebAuthn mfiri a w\u0254ahyehy\u025B.",
  "identities.messages.4000014": "Wonni nne\u025Bma a w\u0254de sie nsan k\u0254 koodu a w\u0254ahyehy\u025B.",
  "identities.messages.4000015": "Saa ak\u0254nt yi nni h\u0254 anaas\u025B wonni ahobamm\u0254 safoa a w\u0254ahyehy\u025B.",
  "identities.messages.4000016": "Nne\u025Bma a w\u0254de sie nsan k\u0254 koodu no ny\u025B nokware.",
  "identities.messages.4000017": "tenten \u025Bs\u025B s\u025B \u025By\u025B <= {max_length}, nanso wunyaa {actual_length}",
