  "identities.messages.4000027": "Ak\u0254nt bi a \u025Bw\u0254 gyinahy\u025Bde koro (email, telefon, din, ...) w\u0254 h\u0254 dedaw. Y\u025Bsr\u025B wo hy\u025Bn mu fa wo ak\u0254nt a \u025Bw\u0254 h\u0254 dedaw no mu s\u025Bnea \u025Bb\u025By\u025B a wob\u025Bfa wo asetra so kratafa bata ho.",
  "identities.messages.4000028": "Wub\u0254\u0254 mm\u0254den s\u025B wob\u025Bhy\u025Bn mu fa {credential_identifier_hint} a ak\u0254nt foforo de redi dwuma dedaw. Wubetumi ahy\u025Bn mu denam {available_credential_types_list} so. Wubetumi ahy\u025Bn mu denam asetra so hy\u025Bnmu a edidi so yi mu biako so: {Available_oidc_providers_list}.",
  "identities.messages.4000029": "\u025Bs\u025B s\u025B \u025Bne {expected} a \u025Bnsakra no y\u025B p\u025B",
  "identities.messages.4000030": "const no antumi any\u025B adwuma",
  "identities.messages.4000031": "W\u0254rentumi mfa as\u025Bmfua no nni dwuma efis\u025B \u025Bte s\u025B gyinahy\u025Bde no pii.",
  "identities.messages.4000032": "\u0190s\u025B s\u025B as\u025Bmfua no tenten y\u025B nkyer\u025Bwde {min_length} koraa, nanso wunyaa {actual_length}.",
  "identities.messages.4000033": "\u0190s\u025B s\u025B as\u025Bmfua no tenten y\u025B nkyer\u025Bwde {max_length} pii, nanso wunyaa {actual_length}.",
