  "identities.messages.4000035": "Saa ak\u0254nt yi nni h\u0254 anaas\u025B w\u0254anhyehy\u025B hy\u025Bnmu a w\u0254de koodu di dwuma.",
  "identities.messages.4000036": "Nne\u025Bma a wode mae no nne nne\u025Bma a na \u025Bw\u0254 saa nhyehy\u025Be yi ho dedaw no.",
  "identities.messages.4000037": "Saa ak\u0254nt yi nni h\u0254 anaas\u025B wonni hy\u025Bnmu \u0254kwan a w\u0254ahyehy\u025B.",
  "identities.messages.4000038": "Captcha nhwehw\u025Bmu no antumi any\u025B adwuma, y\u025Bsr\u025B wo san y\u025B bio.",
