  "consent.scope.openid.title": "\u09AA\u09F0\u09BF\u099A\u09AF\u09BC",
  "consent.scope.openid.description": "\u098F\u09AA\u09CD\u09B2\u09BF\u0995\u09C7\u09B6\u09CD\u09AC\u09A8\u0995 \u0986\u09AA\u09CB\u09A8\u09BE\u09F0 \u09AA\u09F0\u09BF\u099A\u09AF\u09BC \u09AF\u09BE\u099A\u09BE\u0987 \u0995\u09F0\u09BF\u09AC\u09B2\u09C8 \u0985\u09A8\u09C1\u09AE\u09A4\u09BF \u09A6\u09BF\u09AF\u09BC\u09C7\u0964 \u098F\u0987\u099F\u09CB \u09AA\u09CD\u09F0\u09AE\u09BE\u09A3\u09C0\u0995\u09F0\u09A3 \u0986\u09F0\u09C1 \u098F\u099F\u09BE \u09AC\u09BF\u09B6\u09CD\u09AC\u09BE\u09B8\u09AF\u09CB\u0997\u09CD\u09AF \u09B2\u0997\u0987\u09A8 \u0985\u09AD\u09BF\u099C\u09CD\u099E\u09A4\u09BE\u09F0 \u09AC\u09BE\u09AC\u09C7 \u09AA\u09CD\u09F0\u09AF\u09BC\u09CB\u099C\u09A8\u0964",
