  "consent.scope.offline_access.description": "\u098F\u0987 \u098F\u09AA\u09CD\u09B2\u09BF\u0995\u09C7\u09B6\u09CD\u09AC\u09A8\u0995 \u0986\u09AA\u09C1\u09A8\u09BF \u09B8\u0995\u09CD\u09F0\u09BF\u09AF\u09BC\u09AD\u09BE\u09F1\u09C7 \u09AC\u09CD\u09AF\u09F1\u09B9\u09BE\u09F0 \u09A8\u0995\u09F0\u09BE\u09F0 \u09B8\u09AE\u09AF\u09BC\u09A4\u09CB \u0986\u09AA\u09CB\u09A8\u09BE\u0995 \u099B\u09BE\u0987\u09A8 \u0987\u09A8 \u09F0\u09BE\u0996\u09BF\u09AC\u09B2\u09C8 \u0985\u09A8\u09C1\u09AE\u09A4\u09BF \u09A6\u09BF\u09AF\u09BC\u09C7\u0964",
  "consent.scope.profile.title": "\u09AA\u09CD\u09F0'\u09AB\u09BE\u0987\u09B2 \u09A4\u09A5\u09CD\u09AF",
  "consent.scope.profile.description": "\u0986\u09AA\u09CB\u09A8\u09BE\u09F0 \u09AC\u09CD\u09AF\u09F1\u09B9\u09BE\u09F0\u0995\u09BE\u09F0\u09C0 \u09A8\u09BE\u09AE, \u09AA\u09CD\u09F0\u09A5\u09AE \u09A8\u09BE\u09AE, \u0986\u09F0\u09C1 \u09B6\u09C7\u09B7 \u09A8\u09BE\u09AE \u09B8\u09B9 \u0986\u09AA\u09CB\u09A8\u09BE\u09F0 \u09AE\u09CC\u09B2\u09BF\u0995 \u09AA\u09CD\u09F0'\u09AB\u09BE\u0987\u09B2 \u09AC\u09BF\u09F1\u09F0\u09A3\u09B2\u09C8 \u09AA\u09CD\u09F0\u09F1\u09C7\u09B6\u09F0 \u0985\u09A8\u09C1\u09AE\u09A4\u09BF \u09A6\u09BF\u09AF\u09BC\u09C7\u0964",
