  "consent.scope.address.title": "\u09AD\u09CC\u09A4\u09BF\u0995 \u09A0\u09BF\u0995\u09A8\u09BE",
  "consent.scope.address.description": "\u0986\u09AA\u09CB\u09A8\u09BE\u09F0 \u09A1\u09BE\u0995 \u09A0\u09BF\u0995\u09A8\u09BE \u09AA\u09CD\u09F0\u09F1\u09C7\u09B6 \u0995\u09F0\u0995\u0964",
  "consent.scope.phone.title": "\u09AB\u09CB\u09A8 \u09A8\u09AE\u09CD\u09AC\u09F0",
