  "error.footer.text": "\u098F\u0987 \u09A4\u09CD\u09F0\u09C1\u099F\u09BF \u09F0\u09BF\u09AA'\u09F0\u09CD\u099F \u0995\u09F0\u09BE\u09F0 \u09B8\u09AE\u09AF\u09BC\u09A4, \u0985\u09A8\u09C1\u0997\u09CD\u09F0\u09B9 \u0995\u09F0\u09BF \u09A8\u09BF\u09AE\u09CD\u09A8\u09B2\u09BF\u0996\u09BF\u09A4 \u09A4\u09A5\u09CD\u09AF \u0985\u09A8\u09CD\u09A4\u09F0\u09CD\u09AD\u09C1\u0995\u09CD\u09A4 \u0995\u09F0\u0995:",
