  "identities.messages.1060003": "Verdiyiniz e-po\xE7t \xFCnvan\u0131na b\u0259rpa kodu olan bir e-po\xE7t g\xF6nd\u0259rildi. E-po\xE7t almam\u0131s\u0131n\u0131zsa, \xFCnvan\u0131n yaz\u0131l\u0131\u015F\u0131n\u0131 yoxlay\u0131n v\u0259 qeydiyyatdan ke\xE7diyiniz \xFCnvan\u0131 istifad\u0259 etdiyiniz\u0259 \u0259min olun.",
