  "identities.messages.4000028": "{credential_identifier_hint} il\u0259 daxil olma\u011Fa \xE7al\u0131\u015Fd\u0131n\u0131z, bu art\u0131q ba\u015Fqa bir hesab t\u0259r\u0259find\u0259n istifad\u0259 olunur. {available_credential_types_list} istifad\u0259 ed\u0259r\u0259k daxil ola bil\u0259rsiniz. A\u015Fa\u011F\u0131dak\u0131 sosial daxilolma provayderl\u0259rind\u0259n birini istifad\u0259 ed\u0259r\u0259k daxil ola bil\u0259rsiniz: {Available_oidc_providers_list}.",
