  "identities.messages.1080001": "\u042D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u044B \u043B\u0456\u0441\u0442 \u0441\u0430 \u0441\u043F\u0430\u0441\u044B\u043B\u043A\u0430\u0439 \u043F\u0430\u0446\u0432\u0435\u0440\u0434\u0436\u0430\u043D\u043D\u044F \u0431\u044B\u045E \u0430\u0434\u043F\u0440\u0430\u045E\u043B\u0435\u043D\u044B \u043D\u0430 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u044B \u0430\u0434\u0440\u0430\u0441, \u044F\u043A\u0456 \u0432\u044B \u043F\u0430\u043A\u0430\u0437\u0430\u043B\u0456. \u041A\u0430\u043B\u0456 \u0432\u044B \u043D\u0435 \u0430\u0442\u0440\u044B\u043C\u0430\u043B\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u044B \u043B\u0456\u0441\u0442, \u043F\u0440\u0430\u0432\u0435\u0440\u0446\u0435 \u043F\u0440\u0430\u0432\u0456\u043B\u044C\u043D\u0430\u0441\u0446\u044C \u0430\u0434\u0440\u0430\u0441\u0430 \u0456 \u043F\u0435\u0440\u0430\u043A\u0430\u043D\u0430\u0439\u0446\u0435\u0441\u044F, \u0448\u0442\u043E \u0432\u044B\u043A\u0430\u0440\u044B\u0441\u0442\u043E\u045E\u0432\u0430\u0435\u0446\u0435 \u0430\u0434\u0440\u0430\u0441, \u0437 \u044F\u043A\u0456\u043C \u0432\u044B \u0440\u044D\u0433\u0456\u0441\u0442\u0440\u0430\u0432\u0430\u043B\u0456\u0441\u044F.",
