  "identities.messages.4000006": "\u041F\u0430\u0434\u0430\u0434\u0437\u0435\u043D\u044B\u044F \u045E\u043B\u0456\u043A\u043E\u0432\u044B\u044F \u0434\u0430\u043D\u044B\u044F \u043D\u0435\u0434\u0430\u043F\u0443\u0448\u0447\u0430\u043B\u044C\u043D\u044B\u044F, \u043F\u0440\u0430\u0432\u0435\u0440\u0446\u0435 \u043F\u0430\u043C\u044B\u043B\u043A\u0456 \u045E \u043F\u0430\u0440\u043E\u043B\u0456 \u0430\u0431\u043E \u0456\u043C\u0435\u043D\u0456 \u043A\u0430\u0440\u044B\u0441\u0442\u0430\u043B\u044C\u043D\u0456\u043A\u0430, \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u044B\u043C \u0430\u0434\u0440\u0430\u0441\u0435 \u0430\u0431\u043E \u043D\u0443\u043C\u0430\u0440\u044B \u0442\u044D\u043B\u0435\u0444\u043E\u043D\u0430.",
