  "identities.messages.1070017": "Telefonn\xED \u010D\xEDslo",
  "identities.messages.1080001": "E-mail obsahuj\xEDc\xED ov\u011B\u0159ovac\xED odkaz byl odesl\xE1n na e-mailovou adresu, kterou jste uvedli. Pokud jste e-mail neobdr\u017Eeli, zkontrolujte spr\xE1vnost adresy a ujist\u011Bte se, \u017Ee pou\u017E\xEDv\xE1te adresu, se kterou jste se registrovali.",
  "identities.messages.1080002": "\xDAsp\u011B\u0161n\u011B jste ov\u011B\u0159ili svou e-mailovou adresu.",
  "identities.messages.1080003": "E-mail obsahuj\xEDc\xED ov\u011B\u0159ovac\xED k\xF3d byl odesl\xE1n na e-mailovou adresu, kterou jste uvedli. Pokud jste e-mail neobdr\u017Eeli, zkontrolujte spr\xE1vnost adresy a ujist\u011Bte se, \u017Ee pou\u017E\xEDv\xE1te adresu, se kterou jste se registrovali.",
  "identities.messages.4000001": "{reason}",
  "identities.messages.4000002": "Zadejte pros\xEDm {property} a zkuste to znovu.",
  "identities.messages.4000003": "d\xE9lka mus\xED b\xFDt >= {min_length}, ale je {actual_length}",
  "identities.messages.4000004": 'neodpov\xEDd\xE1 vzoru "{pattern}"',
  "identities.messages.4000005": "Heslo nelze pou\u017E\xEDt, proto\u017Ee {reason}.",
  "identities.messages.4000006": "Uveden\xE9 p\u0159ihla\u0161ovac\xED \xFAdaje jsou neplatn\xE9, zkontrolujte p\u0159eklepy ve va\u0161em hesle nebo u\u017Eivatelsk\xE9m jm\xE9nu, e-mailov\xE9 adrese nebo telefonn\xEDm \u010D\xEDsle.",
  "identities.messages.4000007": "\xDA\u010Det se stejn\xFDm identifik\xE1torem (e-mail, telefon, u\u017Eivatelsk\xE9 jm\xE9no, ...) ji\u017E existuje.",
  "identities.messages.4000008": "Zadan\xFD ov\u011B\u0159ovac\xED k\xF3d je neplatn\xFD, zkuste to pros\xEDm znovu.",
  "identities.messages.4000009": "Nebyly nalezeny \u017E\xE1dn\xE9 p\u0159ihla\u0161ovac\xED identifik\xE1tory. Zapomn\u011Bli jste je nastavit? To m\u016F\u017Ee b\xFDt tak\xE9 zp\u016Fsobeno chybnou konfigurac\xED serveru.",
  "identities.messages.4000010": "\xDA\u010Det je\u0161t\u011B nen\xED aktivn\xED. Zapomn\u011Bli jste ov\u011B\u0159it svou e-mailovou adresu?",
  "identities.messages.4000011": "Nem\xE1te nastaven\xE9 \u017E\xE1dn\xE9 TOTP za\u0159\xEDzen\xED.",
  "identities.messages.4000012": "Tento z\xE1lo\u017En\xED obnovovac\xED k\xF3d ji\u017E byl pou\u017Eit.",
  "identities.messages.4000013": "Nem\xE1te nastaven\xE9 \u017E\xE1dn\xE9 WebAuthn za\u0159\xEDzen\xED.",
  "identities.messages.4000014": "Nem\xE1te nastaven\xE9 \u017E\xE1dn\xE9 z\xE1lo\u017En\xED obnovovac\xED k\xF3dy.",
  "identities.messages.4000015": "Tento \xFA\u010Det neexistuje nebo nem\xE1 nastaven\xFD bezpe\u010Dnostn\xED kl\xED\u010D.",
  "identities.messages.4000016": "Z\xE1lo\u017En\xED obnovovac\xED k\xF3d nen\xED platn\xFD.",
  "identities.messages.4000017": "d\xE9lka mus\xED b\xFDt <= {max_length}, ale je {actual_length}",
  "identities.messages.4000018": "mus\xED b\xFDt >= {minimum}, ale je {actual}",
  "identities.messages.4000019": "mus\xED b\xFDt > {minimum}, ale je {actual}",
