  "identities.messages.4000026": "o\u010Dek\xE1v\xE1no {allowed_types_list}, ale z\xEDsk\xE1no {actual_type}",
  "identities.messages.4000027": "\xDA\u010Det se stejn\xFDm identifik\xE1torem (e-mail, telefon, u\u017Eivatelsk\xE9 jm\xE9no, ...) ji\u017E existuje. P\u0159ihlaste se pros\xEDm ke sv\xE9mu existuj\xEDc\xEDmu \xFA\u010Dtu a propojte sv\u016Fj soci\xE1ln\xED profil.",
  "identities.messages.4000028": "Pokusili jste se p\u0159ihl\xE1sit pomoc\xED {credential_identifier_hint}, kter\xFD je ji\u017E pou\u017E\xEDv\xE1n jin\xFDm \xFA\u010Dtem. M\u016F\u017Eete se p\u0159ihl\xE1sit pomoc\xED {available_credential_types_list}. M\u016F\u017Eete se p\u0159ihl\xE1sit pomoc\xED jednoho z n\xE1sleduj\xEDc\xEDch poskytovatel\u016F soci\xE1ln\xEDho p\u0159ihl\xE1\u0161en\xED: {Available_oidc_providers_list}.",
  "identities.messages.4000029": "mus\xED b\xFDt rovno konstant\u011B {expected}",
  "identities.messages.4000030": "konstanta selhala",
  "identities.messages.4000031": "Heslo nelze pou\u017E\xEDt, proto\u017Ee je p\u0159\xEDli\u0161 podobn\xE9 identifik\xE1toru.",
  "identities.messages.4000032": "Heslo mus\xED m\xEDt alespo\u0148 {min_length} znak\u016F, ale m\xE1 {actual_length}.",
  "identities.messages.4000033": "Heslo m\u016F\u017Ee m\xEDt maxim\xE1ln\u011B {max_length} znak\u016F, ale m\xE1 {actual_length}.",
  "identities.messages.4000034": "Heslo bylo nalezeno v datab\xE1zi \xFAnik\u016F dat a nesm\xED b\xFDt nad\xE1le pou\u017E\xEDv\xE1no.",
  "identities.messages.4000035": "Tento \xFA\u010Det neexistuje nebo nem\xE1 nastaven\xE9 p\u0159ihl\xE1\u0161en\xED pomoc\xED k\xF3du.",
  "identities.messages.4000036": "Poskytnut\xE9 vlastnosti neodpov\xEDdaj\xED vlastnostem d\u0159\xEDve spojen\xFDm s t\xEDmto tokem.",
  "identities.messages.4000037": "Tento \xFA\u010Det neexistuje nebo nem\xE1 nakonfigurovanou \u017E\xE1dnou metodu p\u0159ihl\xE1\u0161en\xED.",
