  "error.instructions": "\u0A95\u0AC3\u0AAA\u0ABE \u0A95\u0AB0\u0AC0\u0AA8\u0AC7 \u0AA5\u0ACB\u0AA1\u0AC0 \u0AAE\u0ABF\u0AA8\u0ABF\u0A9F\u0ACB\u0AAE\u0ABE\u0A82 \u0AAB\u0AB0\u0AC0\u0AA5\u0AC0 \u0AAA\u0ACD\u0AB0\u0AAF\u0ABE\u0AB8 \u0A95\u0AB0\u0ACB \u0A85\u0AA5\u0AB5\u0ABE \u0AB5\u0AC7\u0AAC\u0AB8\u0ABE\u0A87\u0A9F \u0AB8\u0A82\u0A9A\u0ABE\u0AB2\u0A95\u0AA8\u0ACB \u0AB8\u0A82\u0AAA\u0AB0\u0ACD\u0A95 \u0A95\u0AB0\u0ACB.",
