  "identities.messages.4000007": "\u05D7\u05E9\u05D1\u05D5\u05DF \u05E2\u05DD \u05D0\u05D5\u05EA\u05D5 \u05DE\u05D6\u05D4\u05D4 (\u05D0\u05D9\u05DE\u05D9\u05D9\u05DC, \u05D8\u05DC\u05E4\u05D5\u05DF, \u05E9\u05DD \u05DE\u05E9\u05EA\u05DE\u05E9, ...) \u05DB\u05D1\u05E8 \u05E7\u05D9\u05D9\u05DD.",
  "identities.messages.4000008": "\u05E7\u05D5\u05D3 \u05D4\u05D0\u05D9\u05DE\u05D5\u05EA \u05E9\u05E1\u05D5\u05E4\u05E7 \u05D0\u05D9\u05E0\u05D5 \u05EA\u05E7\u05D9\u05DF, \u05D0\u05E0\u05D0 \u05E0\u05E1\u05D4 \u05E9\u05D5\u05D1.",
  "identities.messages.4000009": "\u05DC\u05D0 \u05E0\u05DE\u05E6\u05D0\u05D5 \u05DE\u05D6\u05D4\u05D9 \u05DB\u05E0\u05D9\u05E1\u05D4. \u05E9\u05DB\u05D7\u05EA \u05DC\u05D4\u05D2\u05D3\u05D9\u05E8 \u05D0\u05D5\u05EA\u05DD? \u05D6\u05D4 \u05D9\u05DB\u05D5\u05DC \u05DC\u05D4\u05D9\u05D2\u05E8\u05DD \u05D2\u05DD \u05DE\u05EA\u05E6\u05D5\u05E8\u05D4 \u05E9\u05D2\u05D5\u05D9\u05D4 \u05E9\u05DC \u05D4\u05E9\u05E8\u05EA.",
  "identities.messages.4000010": "\u05D4\u05D7\u05E9\u05D1\u05D5\u05DF \u05E2\u05D3\u05D9\u05D9\u05DF \u05DC\u05D0 \u05E4\u05E2\u05D9\u05DC. \u05E9\u05DB\u05D7\u05EA \u05DC\u05D0\u05DE\u05EA \u05D0\u05EA \u05DB\u05EA\u05D5\u05D1\u05EA \u05D4\u05D0\u05D9\u05DE\u05D9\u05D9\u05DC \u05E9\u05DC\u05DA?",
  "identities.messages.4000011": "\u05D0\u05D9\u05DF \u05DC\u05DA \u05DE\u05DB\u05E9\u05D9\u05E8 TOTP \u05DE\u05D5\u05D2\u05D3\u05E8.",
  "identities.messages.4000012": "\u05E7\u05D5\u05D3 \u05E9\u05D7\u05D6\u05D5\u05E8 \u05D4\u05D2\u05D9\u05D1\u05D5\u05D9 \u05D4\u05D6\u05D4 \u05DB\u05D1\u05E8 \u05E0\u05E2\u05E9\u05D4 \u05D1\u05D5 \u05E9\u05D9\u05DE\u05D5\u05E9.",
  "identities.messages.4000013": "\u05D0\u05D9\u05DF \u05DC\u05DA \u05DE\u05DB\u05E9\u05D9\u05E8 WebAuthn \u05DE\u05D5\u05D2\u05D3\u05E8.",
  "identities.messages.4000014": "\u05D0\u05D9\u05DF \u05DC\u05DA \u05E7\u05D5\u05D3\u05D9 \u05E9\u05D7\u05D6\u05D5\u05E8 \u05D2\u05D9\u05D1\u05D5\u05D9 \u05DE\u05D5\u05D2\u05D3\u05E8\u05D9\u05DD.",
  "identities.messages.4000015": "\u05D7\u05E9\u05D1\u05D5\u05DF \u05D6\u05D4 \u05DC\u05D0 \u05E7\u05D9\u05D9\u05DD \u05D0\u05D5 \u05E9\u05D0\u05D9\u05DF \u05DC\u05D5 \u05DE\u05E4\u05EA\u05D7 \u05D0\u05D1\u05D8\u05D7\u05D4 \u05DE\u05D5\u05D2\u05D3\u05E8.",
  "identities.messages.4000016": "\u05E7\u05D5\u05D3 \u05E9\u05D7\u05D6\u05D5\u05E8 \u05D4\u05D2\u05D9\u05D1\u05D5\u05D9 \u05D0\u05D9\u05E0\u05D5 \u05EA\u05E7\u05D9\u05DF.",
  "identities.messages.4000017": "\u05D0\u05D5\u05E8\u05DA \u05D7\u05D9\u05D9\u05D1 \u05DC\u05D4\u05D9\u05D5\u05EA <= {max_length}, \u05D0\u05DA \u05E7\u05D9\u05D1\u05DC\u05EA {actual_length}",
  "identities.messages.4000018": "\u05D7\u05D9\u05D9\u05D1 \u05DC\u05D4\u05D9\u05D5\u05EA >= {minimum} \u05D0\u05DA \u05E0\u05DE\u05E6\u05D0 {actual}",
  "identities.messages.4000019": "\u05D7\u05D9\u05D9\u05D1 \u05DC\u05D4\u05D9\u05D5\u05EA > {minimum} \u05D0\u05DA \u05E0\u05DE\u05E6\u05D0 {actual}",
  "identities.messages.4000020": "\u05D7\u05D9\u05D9\u05D1 \u05DC\u05D4\u05D9\u05D5\u05EA <= {maximum} \u05D0\u05DA \u05E0\u05DE\u05E6\u05D0 {actual}",
  "identities.messages.4000021": "\u05D7\u05D9\u05D9\u05D1 \u05DC\u05D4\u05D9\u05D5\u05EA < {maximum} \u05D0\u05DA \u05E0\u05DE\u05E6\u05D0 {actual}",
  "identities.messages.4000022": "{actual} \u05DC\u05D0 \u05DE\u05DB\u05E4\u05DC\u05D4 \u05E9\u05DC {base}",
  "identities.messages.4000023": "\u05DE\u05E7\u05E1\u05D9\u05DE\u05D5\u05DD {max_items} \u05E4\u05E8\u05D9\u05D8\u05D9\u05DD \u05DE\u05D5\u05EA\u05E8\u05D9\u05DD, \u05D0\u05DA \u05E0\u05DE\u05E6\u05D0\u05D5 {actual_items} \u05E4\u05E8\u05D9\u05D8\u05D9\u05DD",
  "identities.messages.4000024": "\u05DE\u05D9\u05E0\u05D9\u05DE\u05D5\u05DD {min_items} \u05E4\u05E8\u05D9\u05D8\u05D9\u05DD \u05DE\u05D5\u05EA\u05E8\u05D9\u05DD, \u05D0\u05DA \u05E0\u05DE\u05E6\u05D0\u05D5 {actual_items} \u05E4\u05E8\u05D9\u05D8\u05D9\u05DD",
  "identities.messages.4000025": "\u05E4\u05E8\u05D9\u05D8\u05D9\u05DD \u05D1\u05D0\u05D9\u05E0\u05D3\u05E7\u05E1 {index_a} \u05D5-{index_b} \u05E9\u05D5\u05D5\u05D9\u05DD",
  "identities.messages.4000026": "\u05E6\u05E4\u05D5\u05D9 {allowed_types_list}, \u05D0\u05DA \u05E7\u05D9\u05D1\u05DC\u05EA {actual_type}",
  "identities.messages.4000027": "\u05D7\u05E9\u05D1\u05D5\u05DF \u05E2\u05DD \u05D0\u05D5\u05EA\u05D5 \u05DE\u05D6\u05D4\u05D4 (\u05D0\u05D9\u05DE\u05D9\u05D9\u05DC, \u05D8\u05DC\u05E4\u05D5\u05DF, \u05E9\u05DD \u05DE\u05E9\u05EA\u05DE\u05E9, ...) \u05DB\u05D1\u05E8 \u05E7\u05D9\u05D9\u05DD. \u05D0\u05E0\u05D0 \u05D4\u05EA\u05D7\u05D1\u05E8 \u05DC\u05D7\u05E9\u05D1\u05D5\u05DF \u05D4\u05E7\u05D9\u05D9\u05DD \u05E9\u05DC\u05DA \u05DB\u05D3\u05D9 \u05DC\u05E7\u05E9\u05E8 \u05D0\u05EA \u05D4\u05E4\u05E8\u05D5\u05E4\u05D9\u05DC \u05D4\u05D7\u05D1\u05E8\u05EA\u05D9 \u05E9\u05DC\u05DA.",
  "identities.messages.4000028": "\u05E0\u05D9\u05E1\u05D9\u05EA \u05DC\u05D4\u05EA\u05D7\u05D1\u05E8 \u05E2\u05DD {credential_identifier_hint} \u05E9\u05DB\u05D1\u05E8 \u05D1\u05E9\u05D9\u05DE\u05D5\u05E9 \u05E9\u05DC \u05D7\u05E9\u05D1\u05D5\u05DF \u05D0\u05D7\u05E8. \u05EA\u05D5\u05DB\u05DC \u05DC\u05D4\u05EA\u05D7\u05D1\u05E8 \u05D1\u05D0\u05DE\u05E6\u05E2\u05D5\u05EA {available_credential_types_list}. \u05EA\u05D5\u05DB\u05DC \u05DC\u05D4\u05EA\u05D7\u05D1\u05E8 \u05D1\u05D0\u05DE\u05E6\u05E2\u05D5\u05EA \u05D0\u05D7\u05D3 \u05DE\u05E1\u05E4\u05E7\u05D9 \u05D4\u05DB\u05E0\u05D9\u05E1\u05D4 \u05D4\u05D7\u05D1\u05E8\u05EA\u05D9\u05EA \u05D4\u05D1\u05D0\u05D9\u05DD: {Available_oidc_providers_list}.",
  "identities.messages.4000029": "\u05D7\u05D9\u05D9\u05D1 \u05DC\u05D4\u05D9\u05D5\u05EA \u05E9\u05D5\u05D5\u05D4 \u05DC\u05E7\u05D1\u05D5\u05E2 {expected}",
  "identities.messages.4000030": "const \u05E0\u05DB\u05E9\u05DC",
  "identities.messages.4000031": "\u05DC\u05D0 \u05E0\u05D9\u05EA\u05DF \u05DC\u05D4\u05E9\u05EA\u05DE\u05E9 \u05D1\u05E1\u05D9\u05E1\u05DE\u05D4 \u05DE\u05DB\u05D9\u05D5\u05D5\u05DF \u05E9\u05D4\u05D9\u05D0 \u05D3\u05D5\u05DE\u05D4 \u05DE\u05D3\u05D9 \u05DC\u05DE\u05D6\u05D4\u05D4.",
  "identities.messages.4000032": "\u05D4\u05E1\u05D9\u05E1\u05DE\u05D4 \u05D7\u05D9\u05D9\u05D1\u05EA \u05DC\u05D4\u05D9\u05D5\u05EA \u05D1\u05D0\u05D5\u05E8\u05DA \u05E9\u05DC \u05DC\u05E4\u05D7\u05D5\u05EA {min_length} \u05EA\u05D5\u05D5\u05D9\u05DD, \u05D0\u05DA \u05E7\u05D9\u05D1\u05DC\u05EA {actual_length}.",
  "identities.messages.4000033": "\u05D4\u05E1\u05D9\u05E1\u05DE\u05D4 \u05D9\u05DB\u05D5\u05DC\u05D4 \u05DC\u05D4\u05D9\u05D5\u05EA \u05D1\u05D0\u05D5\u05E8\u05DA \u05E9\u05DC \u05DC\u05DB\u05DC \u05D4\u05D9\u05D5\u05EA\u05E8 {max_length} \u05EA\u05D5\u05D5\u05D9\u05DD, \u05D0\u05DA \u05E7\u05D9\u05D1\u05DC\u05EA {actual_length}.",
  "identities.messages.4000034": "\u05D4\u05E1\u05D9\u05E1\u05DE\u05D4 \u05E0\u05DE\u05E6\u05D0\u05D4 \u05D1\u05D3\u05DC\u05D9\u05E4\u05D5\u05EA \u05DE\u05D9\u05D3\u05E2 \u05D5\u05D0\u05E1\u05D5\u05E8 \u05E2\u05D5\u05D3 \u05DC\u05D4\u05E9\u05EA\u05DE\u05E9 \u05D1\u05D4.",
  "identities.messages.4000035": "\u05D7\u05E9\u05D1\u05D5\u05DF \u05D6\u05D4 \u05DC\u05D0 \u05E7\u05D9\u05D9\u05DD \u05D0\u05D5 \u05E9\u05DC\u05D0 \u05D4\u05D2\u05D3\u05D9\u05E8 \u05DB\u05E0\u05D9\u05E1\u05D4 \u05E2\u05DD \u05E7\u05D5\u05D3.",
  "identities.messages.4000036": "\u05D4\u05DE\u05D0\u05E4\u05D9\u05D9\u05E0\u05D9\u05DD \u05E9\u05E1\u05D5\u05E4\u05E7\u05D5 \u05D0\u05D9\u05E0\u05DD \u05EA\u05D5\u05D0\u05DE\u05D9\u05DD \u05DC\u05DE\u05D0\u05E4\u05D9\u05D9\u05E0\u05D9\u05DD \u05E9\u05E7\u05D5\u05E9\u05E8\u05D5 \u05D1\u05E2\u05D1\u05E8 \u05DC\u05EA\u05D4\u05DC\u05D9\u05DA \u05D6\u05D4.",
