  "identities.messages.4010001": "\u05EA\u05D4\u05DC\u05D9\u05DA \u05D4\u05DB\u05E0\u05D9\u05E1\u05D4 \u05E4\u05D2 \u05EA\u05D5\u05E7\u05E4\u05D5 \u05DC\u05E4\u05E0\u05D9 {expired_at_unix_since_minutes} \u05D3\u05E7\u05D5\u05EA, \u05D0\u05E0\u05D0 \u05E0\u05E1\u05D4 \u05E9\u05D5\u05D1.",
  "identities.messages.4010002": "\u05DC\u05D0 \u05E0\u05DE\u05E6\u05D0\u05D4 \u05D0\u05E1\u05D8\u05E8\u05D8\u05D2\u05D9\u05D4 \u05DC\u05D4\u05EA\u05D7\u05D1\u05E8\u05D5\u05EA. \u05DE\u05D9\u05DC\u05D0\u05EA \u05D0\u05EA \u05D4\u05D8\u05D5\u05E4\u05E1 \u05E0\u05DB\u05D5\u05DF?",
  "identities.messages.4010003": "\u05DC\u05D0 \u05E0\u05DE\u05E6\u05D0\u05D4 \u05D0\u05E1\u05D8\u05E8\u05D8\u05D2\u05D9\u05D4 \u05DC\u05D4\u05E8\u05E9\u05DE\u05D4. \u05DE\u05D9\u05DC\u05D0\u05EA \u05D0\u05EA \u05D4\u05D8\u05D5\u05E4\u05E1 \u05E0\u05DB\u05D5\u05DF?",
  "identities.messages.4010004": "\u05DC\u05D0 \u05E0\u05DE\u05E6\u05D0\u05D4 \u05D0\u05E1\u05D8\u05E8\u05D8\u05D2\u05D9\u05D4 \u05DC\u05E2\u05D3\u05DB\u05D5\u05DF \u05D4\u05D4\u05D2\u05D3\u05E8\u05D5\u05EA \u05E9\u05DC\u05DA. \u05DE\u05D9\u05DC\u05D0\u05EA \u05D0\u05EA \u05D4\u05D8\u05D5\u05E4\u05E1 \u05E0\u05DB\u05D5\u05DF?",
  "identities.messages.4010005": "\u05DC\u05D0 \u05E0\u05DE\u05E6\u05D0\u05D4 \u05D0\u05E1\u05D8\u05E8\u05D8\u05D2\u05D9\u05D4 \u05DC\u05E9\u05D7\u05D6\u05D5\u05E8 \u05D4\u05D7\u05E9\u05D1\u05D5\u05DF \u05E9\u05DC\u05DA. \u05DE\u05D9\u05DC\u05D0\u05EA \u05D0\u05EA \u05D4\u05D8\u05D5\u05E4\u05E1 \u05E0\u05DB\u05D5\u05DF?",
  "identities.messages.4010006": "\u05DC\u05D0 \u05E0\u05DE\u05E6\u05D0\u05D4 \u05D0\u05E1\u05D8\u05E8\u05D8\u05D2\u05D9\u05D4 \u05DC\u05D0\u05D9\u05DE\u05D5\u05EA \u05D4\u05D7\u05E9\u05D1\u05D5\u05DF \u05E9\u05DC\u05DA. \u05DE\u05D9\u05DC\u05D0\u05EA \u05D0\u05EA \u05D4\u05D8\u05D5\u05E4\u05E1 \u05E0\u05DB\u05D5\u05DF?",
  "identities.messages.4010007": "\u05D4\u05D1\u05E7\u05E9\u05D4 \u05DB\u05D1\u05E8 \u05D4\u05D5\u05E9\u05DC\u05DE\u05D4 \u05D1\u05D4\u05E6\u05DC\u05D7\u05D4 \u05D5\u05DC\u05D0 \u05E0\u05D9\u05EA\u05DF \u05DC\u05D7\u05D6\u05D5\u05E8 \u05E2\u05DC\u05D9\u05D4.",
  "identities.messages.4010008": "\u05E7\u05D5\u05D3 \u05D4\u05DB\u05E0\u05D9\u05E1\u05D4 \u05D0\u05D9\u05E0\u05D5 \u05EA\u05E7\u05D9\u05DF \u05D0\u05D5 \u05E9\u05DB\u05D1\u05E8 \u05E0\u05E2\u05E9\u05D4 \u05D1\u05D5 \u05E9\u05D9\u05DE\u05D5\u05E9. \u05D0\u05E0\u05D0 \u05E0\u05E1\u05D4 \u05E9\u05D5\u05D1.",
  "identities.messages.4010009": "\u05D0\u05D9\u05E9\u05D5\u05E8\u05D9\u05DD \u05DE\u05E7\u05D5\u05E9\u05E8\u05D9\u05DD \u05D0\u05D9\u05E0\u05DD \u05EA\u05D5\u05D0\u05DE\u05D9\u05DD.",
