  "consent.scope.profile.title": "\u092A\u094D\u0930\u094B\u092B\u093E\u0907\u0932 \u091C\u093E\u0928\u0915\u093E\u0930\u0940",
  "consent.scope.profile.description": "\u0906\u092A\u0915\u0947 \u092C\u0941\u0928\u093F\u092F\u093E\u0926\u0940 \u092A\u094D\u0930\u094B\u092B\u093E\u0907\u0932 \u0935\u093F\u0935\u0930\u0923\u094B\u0902, \u091C\u093F\u0938\u092E\u0947\u0902 \u0906\u092A\u0915\u093E \u0909\u092A\u092F\u094B\u0917\u0915\u0930\u094D\u0924\u093E \u0928\u093E\u092E, \u092A\u0939\u0932\u093E \u0928\u093E\u092E \u0914\u0930 \u0905\u0902\u0924\u093F\u092E \u0928\u093E\u092E \u0936\u093E\u092E\u093F\u0932 \u0939\u0948, \u0924\u0915 \u092A\u0939\u0941\u0902\u091A\u0928\u0947 \u0915\u0940 \u0905\u0928\u0941\u092E\u0924\u093F \u0926\u0947\u0924\u093E \u0939\u0948\u0964",
  "consent.scope.email.title": "\u0908\u092E\u0947\u0932 \u092A\u0924\u093E",
  "consent.scope.email.description": "\u0906\u092A\u0915\u0947 \u0908\u092E\u0947\u0932 \u092A\u0924\u093E \u0914\u0930 \u0907\u0938\u0915\u0940 \u0938\u0924\u094D\u092F\u093E\u092A\u0928 \u0938\u094D\u0925\u093F\u0924\u093F \u0915\u094B \u092A\u094D\u0930\u093E\u092A\u094D\u0924 \u0915\u0930\u0947\u0902\u0964",
  "consent.scope.address.title": "\u092D\u094C\u0924\u093F\u0915 \u092A\u0924\u093E",
  "consent.scope.address.description": "\u0906\u092A\u0915\u0947 \u092A\u094B\u0938\u094D\u091F\u0932 \u092A\u0924\u093E \u0924\u0915 \u092A\u0939\u0941\u0902\u091A\u0947\u0902\u0964",
  "consent.scope.phone.title": "\u092B\u094B\u0928 \u0928\u0902\u092C\u0930",
  "consent.scope.phone.description": "\u0906\u092A\u0915\u0947 \u092B\u094B\u0928 \u0928\u0902\u092C\u0930 \u0914\u0930 \u0907\u0938\u0915\u0940 \u0938\u0924\u094D\u092F\u093E\u092A\u0928 \u0938\u094D\u0925\u093F\u0924\u093F \u0915\u094B \u092A\u094D\u0930\u093E\u092A\u094D\u0924 \u0915\u0930\u0947\u0902\u0964",
  "error.title.what-happened": "\u0915\u094D\u092F\u093E \u0939\u0941\u0906?",
  "error.title.what-can-i-do": "\u092E\u0948\u0902 \u0915\u094D\u092F\u093E \u0915\u0930 \u0938\u0915\u0924\u093E \u0939\u0942\u0902?",
  "error.instructions": "\u0915\u0943\u092A\u092F\u093E \u0915\u0941\u091B \u092E\u093F\u0928\u091F\u094B\u0902 \u0915\u0947 \u092C\u093E\u0926 \u092B\u093F\u0930 \u0938\u0947 \u092A\u094D\u0930\u092F\u093E\u0938 \u0915\u0930\u0947\u0902 \u092F\u093E \u0935\u0947\u092C\u0938\u093E\u0907\u091F \u0911\u092A\u0930\u0947\u091F\u0930 \u0938\u0947 \u0938\u0902\u092A\u0930\u094D\u0915 \u0915\u0930\u0947\u0902\u0964",
  "error.footer.text": "\u0907\u0938 \u0924\u094D\u0930\u0941\u091F\u093F \u0915\u0940 \u0930\u093F\u092A\u094B\u0930\u094D\u091F \u0915\u0930\u0924\u0947 \u0938\u092E\u092F, \u0915\u0943\u092A\u092F\u093E \u0928\u093F\u092E\u094D\u0928\u0932\u093F\u0916\u093F\u0924 \u091C\u093E\u0928\u0915\u093E\u0930\u0940 \u0936\u093E\u092E\u093F\u0932 \u0915\u0930\u0947\u0902:",
  "error.footer.copy": "\u0915\u0949\u092A\u0940 \u0915\u0930\u0947\u0902",
  "error.action.go-back": "\u0935\u093E\u092A\u0938 \u091C\u093E\u090F\u0902",
  "consent.action-accept": "\u0905\u0928\u0941\u092E\u0924\u093F \u0926\u0947\u0902",
  "consent.action-reject": "\u0905\u0938\u094D\u0935\u0940\u0915\u0943\u0924 \u0915\u0930\u0947\u0902",
  "consent.description": "\u0915\u0947\u0935\u0932 \u0909\u0938 \u0938\u093E\u0907\u091F \u092F\u093E \u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u0915\u094B \u0905\u0928\u0941\u092E\u0924\u093F \u0926\u0947\u0902 \u0905\u0917\u0930 \u0906\u092A \u0907\u0938 \u092A\u0930 \u0935\u093F\u0936\u094D\u0935\u093E\u0938 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964 \u0906\u092A\u0915\u094B \u0938\u092D\u0940 \u0905\u0928\u0941\u092E\u0924\u093F\u092F\u094B\u0902 \u0915\u094B \u0938\u094D\u0935\u0940\u0915\u093E\u0930 \u0915\u0930\u0928\u0947 \u0915\u0940 \u0906\u0935\u0936\u094D\u092F\u0915\u0924\u093E \u0928\u0939\u0940\u0902 \u0939\u0948\u0964",
  "consent.privacy-policy-label": "\u0917\u094B\u092A\u0928\u0940\u092F\u0924\u093E \u0928\u0940\u0924\u093F",
  "consent.remember-label": "\u0905\u0917\u0932\u0940 \u092C\u093E\u0930 \u0907\u0938 \u0928\u093F\u0930\u094D\u0923\u092F \u0915\u094B \u092F\u093E\u0926 \u0930\u0916\u0947\u0902\u0964 \u0906\u092A\u0915\u0940 \u0938\u0939\u092E\u0924\u093F \u0915\u0947 \u092C\u093F\u0928\u093E \u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u0905\u0924\u093F\u0930\u093F\u0915\u094D\u0924 \u0905\u0928\u0941\u092E\u0924\u093F\u092F\u093E\u0902 \u092E\u093E\u0902\u0917 \u0928\u0939\u0940\u0902 \u0938\u0915\u0947\u0917\u093E\u0964",
  "consent.remember-tooltip": "\u092E\u0947\u0930\u093E \u0928\u093F\u0930\u094D\u0923\u092F \u092F\u093E\u0926 \u0930\u0916\u0947\u0902",
  "consent.requested-permissions-label": "\u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u0928\u093F\u092E\u094D\u0928\u0932\u093F\u0916\u093F\u0924 \u0905\u0928\u0941\u092E\u0924\u093F\u092F\u094B\u0902 \u0915\u0947 \u0932\u093F\u090F \u0905\u0928\u0941\u0930\u094B\u0927 \u0915\u0930\u0924\u093E \u0939\u0948:",
  "consent.terms-of-service-label": "\u0938\u0947\u0935\u093E \u0915\u0940 \u0936\u0930\u094D\u0924\u0947\u0902",
  "error.back-button": "\u0935\u093E\u092A\u0938 \u091C\u093E\u090F\u0902",
  "error.description": "\u0928\u093F\u092E\u094D\u0928\u0932\u093F\u0916\u093F\u0924 \u0938\u0902\u0926\u0947\u0936 \u0915\u0947 \u0938\u093E\u0925 \u090F\u0915 \u0924\u094D\u0930\u0941\u091F\u093F \u0939\u0941\u0908:",
  "error.support-email-link": "\u092F\u0926\u093F \u0938\u092E\u0938\u094D\u092F\u093E \u091C\u093E\u0930\u0940 \u0930\u0939\u0924\u0940 \u0939\u0948, \u0924\u094B \u0915\u0943\u092A\u092F\u093E <a>{contactSupportEmail}</a> \u0938\u0947 \u0938\u0902\u092A\u0930\u094D\u0915 \u0915\u0930\u0947\u0902",
