  "identities.messages.1050019": "Jelsz\xF3kulcs hozz\xE1ad\xE1sa",
  "identities.messages.1050020": 'Jelsz\xF3kulcs elt\xE1vol\xEDt\xE1sa: "{display_name}"',
  "identities.messages.1060001": "Sikeresen helyre\xE1ll\xEDtotta a fi\xF3kj\xE1t. K\xE9rj\xFCk, v\xE1ltoztassa meg jelszav\xE1t, vagy \xE1ll\xEDtson be alternat\xEDv bejelentkez\xE9si m\xF3dot (pl. k\xF6z\xF6ss\xE9gi bejelentkez\xE9s) a k\xF6vetkez\u0151 {privileged_session_expires_at_unix_until_minutes} percen bel\xFCl.",
  "identities.messages.1060002": "Egy helyre\xE1ll\xEDt\xE1si linket tartalmaz\xF3 e-mailt k\xFCldt\xFCnk a megadott e-mail c\xEDmre. Ha nem kapott e-mailt, ellen\u0151rizze a c\xEDm helyes\xEDr\xE1s\xE1t, \xE9s gy\u0151z\u0151dj\xF6n meg r\xF3la, hogy a regisztr\xE1ci\xF3kor haszn\xE1lt c\xEDmet haszn\xE1lja.",
  "identities.messages.1060003": "Egy helyre\xE1ll\xEDt\xE1si k\xF3dot tartalmaz\xF3 e-mailt k\xFCldt\xFCnk a megadott e-mail c\xEDmre. Ha nem kapott e-mailt, ellen\u0151rizze a c\xEDm helyes\xEDr\xE1s\xE1t, \xE9s gy\u0151z\u0151dj\xF6n meg r\xF3la, hogy a regisztr\xE1ci\xF3kor haszn\xE1lt c\xEDmet haszn\xE1lja.",
  "identities.messages.1060004": 'Egy helyre\xE1ll\xEDt\xE1si k\xF3dot k\xFCldt\xFCnk ide: "{masked_address}". Ha nem kapta meg, ellen\u0151rizze a c\xEDm helyes\xEDr\xE1s\xE1t, \xE9s gy\u0151z\u0151dj\xF6n meg r\xF3la, hogy a regisztr\xE1ci\xF3kor haszn\xE1lt c\xEDmet haszn\xE1lja.',
  "identities.messages.1060005": "\xC1ll\xEDtsa helyre a fi\xF3kj\xE1hoz val\xF3 hozz\xE1f\xE9r\xE9st a helyre\xE1ll\xEDt\xE1si c\xEDm teljes megad\xE1s\xE1val.",
