  "identities.messages.1070016": "Helyre\xE1ll\xEDt\xE1si c\xEDm",
  "identities.messages.1070017": "Telefonsz\xE1m",
  "identities.messages.1080001": "Egy ellen\u0151rz\u0151 linket tartalmaz\xF3 e-mailt k\xFCldt\xFCnk a megadott e-mail c\xEDmre. Ha nem kapott e-mailt, ellen\u0151rizze a c\xEDm helyes\xEDr\xE1s\xE1t, \xE9s gy\u0151z\u0151dj\xF6n meg r\xF3la, hogy a regisztr\xE1ci\xF3kor haszn\xE1lt c\xEDmet haszn\xE1lja.",
  "identities.messages.1080002": "Sikeresen ellen\u0151rizte az e-mail c\xEDm\xE9t.",
  "identities.messages.1080003": "Egy ellen\u0151rz\u0151 k\xF3dot tartalmaz\xF3 e-mailt k\xFCldt\xFCnk a megadott e-mail c\xEDmre. Ha nem kapott e-mailt, ellen\u0151rizze a c\xEDm helyes\xEDr\xE1s\xE1t, \xE9s gy\u0151z\u0151dj\xF6n meg r\xF3la, hogy a regisztr\xE1ci\xF3kor haszn\xE1lt c\xEDmet haszn\xE1lja.",
  "identities.messages.4000001": "{reason}",
  "identities.messages.4000002": "K\xE9rj\xFCk, adja meg a k\xF6vetkez\u0151t: {property} \xE9s pr\xF3b\xE1lja \xFAjra.",
  "identities.messages.4000003": "a hossznak >= {min_length} kell lennie, de {actual_length} lett",
