  "identities.messages.4000005": "A jelsz\xF3 nem haszn\xE1lhat\xF3, mert {reason}.",
  "identities.messages.4000006": "A megadott hiteles\xEDt\u0151 adatok \xE9rv\xE9nytelenek, ellen\u0151rizze a jelsz\xF3 vagy felhaszn\xE1l\xF3n\xE9v, e-mail c\xEDm vagy telefonsz\xE1m helyes\xEDr\xE1s\xE1t.",
  "identities.messages.4000007": "Ugyanezzel az azonos\xEDt\xF3val (e-mail, telefon, felhaszn\xE1l\xF3n\xE9v, ...) m\xE1r l\xE9tezik egy fi\xF3k.",
  "identities.messages.4000008": "A megadott hiteles\xEDt\xE9si k\xF3d \xE9rv\xE9nytelen, k\xE9rj\xFCk, pr\xF3b\xE1lja \xFAjra.",
  "identities.messages.4000009": "Nem tal\xE1lhat\xF3 bejelentkez\xE9si azonos\xEDt\xF3. Elfelejtette be\xE1ll\xEDtani? Ezt szerver hib\xE1s konfigur\xE1ci\xF3ja is okozhatja.",
  "identities.messages.4000010": "A fi\xF3k m\xE9g nem akt\xEDv. Elfelejtette ellen\u0151rizni az e-mail c\xEDm\xE9t?",
  "identities.messages.4000011": "Nincs be\xE1ll\xEDtva TOTP eszk\xF6z.",
  "identities.messages.4000012": "Ezt a biztons\xE1gi ment\xE9si helyre\xE1ll\xEDt\xE1si k\xF3dot m\xE1r haszn\xE1lt\xE1k.",
  "identities.messages.4000013": "Nincs be\xE1ll\xEDtva WebAuthn eszk\xF6z.",
  "identities.messages.4000014": "Nincsenek be\xE1ll\xEDtva biztons\xE1gi ment\xE9si helyre\xE1ll\xEDt\xE1si k\xF3dok.",
  "identities.messages.4000015": "Ez a fi\xF3k nem l\xE9tezik, vagy nincs be\xE1ll\xEDtva biztons\xE1gi kulcs.",
  "identities.messages.4000016": "A biztons\xE1gi ment\xE9si helyre\xE1ll\xEDt\xE1si k\xF3d nem \xE9rv\xE9nyes.",
  "identities.messages.4000017": "a hossznak <= {max_length} kell lennie, de {actual_length} lett",
  "identities.messages.4000018": ">= {minimum} kell lennie, de {actual} lett",
  "identities.messages.4000019": "> {minimum} kell lennie, de {actual} lett",
  "identities.messages.4000020": "<= {maximum} kell lennie, de {actual} lett",
  "identities.messages.4000021": "< {maximum} kell lennie, de {actual} lett",
  "identities.messages.4000022": "{actual} nem {base} t\xF6bbsz\xF6r\xF6se",
  "identities.messages.4000023": "maximum {max_items} elem enged\xE9lyezett, de {actual_items} elem tal\xE1lhat\xF3",
  "identities.messages.4000024": "minimum {min_items} elem enged\xE9lyezett, de {actual_items} elem tal\xE1lhat\xF3",
  "identities.messages.4000025": "az elemek a(z) {index_a} \xE9s {index_b} indexn\xE9l megegyeznek",
  "identities.messages.4000026": "{allowed_types_list} v\xE1rhat\xF3, de {actual_type} lett",
  "identities.messages.4000027": "Ugyanezzel az azonos\xEDt\xF3val (e-mail, telefon, felhaszn\xE1l\xF3n\xE9v, ...) m\xE1r l\xE9tezik egy fi\xF3k. K\xE9rj\xFCk, jelentkezzen be a megl\xE9v\u0151 fi\xF3kj\xE1ba a k\xF6z\xF6ss\xE9gi profilja \xF6sszekapcsol\xE1s\xE1hoz.",
  "identities.messages.4000028": "A k\xF6vetkez\u0151vel pr\xF3b\xE1lt bejelentkezni: {credential_identifier_hint}, amely m\xE1r haszn\xE1latban van egy m\xE1sik fi\xF3k \xE1ltal. Bejelentkezhet a k\xF6vetkez\u0151 haszn\xE1lat\xE1val: {available_credential_types_list}. Bejelentkezhet a k\xF6vetkez\u0151 k\xF6z\xF6ss\xE9gi bejelentkez\xE9si szolg\xE1ltat\xF3k egyik\xE9vel: {Available_oidc_providers_list}.",
  "identities.messages.4000029": "egyenl\u0151nek kell lennie a k\xF6vetkez\u0151 konstanssal: {expected}",
  "identities.messages.4000030": "konstans sikertelen",
  "identities.messages.4000031": "A jelsz\xF3 nem haszn\xE1lhat\xF3, mert t\xFAl hasonl\xF3 az azonos\xEDt\xF3hoz.",
  "identities.messages.4000032": "A jelsz\xF3nak legal\xE1bb {min_length} karakter hossz\xFAnak kell lennie, de {actual_length} lett.",
  "identities.messages.4000033": "A jelsz\xF3 legfeljebb {max_length} karakter hossz\xFA lehet, de {actual_length} lett.",
  "identities.messages.4000034": "A jelsz\xF3t adatsziv\xE1rg\xE1sokban tal\xE1lt\xE1k, \xE9s t\xF6bb\xE9 nem haszn\xE1lhat\xF3.",
  "identities.messages.4000035": "Ez a fi\xF3k nem l\xE9tezik, vagy nincs be\xE1ll\xEDtva a k\xF3dos bejelentkez\xE9s.",
  "identities.messages.4000036": "A megadott tulajdons\xE1gok nem egyeznek a folyamathoz kor\xE1bban t\xE1rs\xEDtott tulajdons\xE1gokkal.",
  "identities.messages.4000037": "Ez a fi\xF3k nem l\xE9tezik, vagy nincs konfigur\xE1lva bejelentkez\xE9si m\xF3dszer.",
  "identities.messages.4000038": "A Captcha ellen\u0151rz\xE9s sikertelen, k\xE9rj\xFCk, pr\xF3b\xE1lja \xFAjra.",
  "identities.messages.4010001": "A bejelentkez\xE9si folyamat {expired_at_unix_since_minutes} perccel ezel\u0151tt lej\xE1rt, k\xE9rj\xFCk, pr\xF3b\xE1lja \xFAjra.",
  "identities.messages.4010002": "Nem tal\xE1lhat\xF3 strat\xE9gia a bejelentkez\xE9shez. Helyesen t\xF6lt\xF6tte ki az \u0171rlapot?",
  "identities.messages.4010003": "Nem tal\xE1lhat\xF3 strat\xE9gia a regisztr\xE1ci\xF3hoz. Helyesen t\xF6lt\xF6tte ki az \u0171rlapot?",
  "identities.messages.4010004": "Nem tal\xE1lhat\xF3 strat\xE9gia a be\xE1ll\xEDt\xE1sok friss\xEDt\xE9s\xE9hez. Helyesen t\xF6lt\xF6tte ki az \u0171rlapot?",
  "identities.messages.4010005": "Nem tal\xE1lhat\xF3 strat\xE9gia a fi\xF3k helyre\xE1ll\xEDt\xE1s\xE1hoz. Helyesen t\xF6lt\xF6tte ki az \u0171rlapot?",
  "identities.messages.4010006": "Nem tal\xE1lhat\xF3 strat\xE9gia a fi\xF3k ellen\u0151rz\xE9s\xE9hez. Helyesen t\xF6lt\xF6tte ki az \u0171rlapot?",
  "identities.messages.4010007": "A k\xE9r\xE9s m\xE1r sikeresen befejez\u0151d\xF6tt \xE9s nem ism\xE9telhet\u0151 meg.",
  "identities.messages.4010008": "A bejelentkez\xE9si k\xF3d \xE9rv\xE9nytelen vagy m\xE1r haszn\xE1lt\xE1k. K\xE9rj\xFCk, pr\xF3b\xE1lja \xFAjra.",
  "identities.messages.4010009": "Az \xF6sszekapcsolt hiteles\xEDt\u0151 adatok nem egyeznek.",
  "identities.messages.4010010": "A megadott c\xEDm nem egyezik a jelenlegi fi\xF3kban tal\xE1lhat\xF3 ismert c\xEDmekkel.",
