  "identities.messages.4040002": "A k\xE9r\xE9s m\xE1r sikeresen befejez\u0151d\xF6tt \xE9s nem ism\xE9telhet\u0151 meg.",
  "identities.messages.4040003": "A regisztr\xE1ci\xF3s k\xF3d \xE9rv\xE9nytelen vagy m\xE1r haszn\xE1lt\xE1k. K\xE9rj\xFCk, pr\xF3b\xE1lja \xFAjra.",
  "identities.messages.4050001": "A be\xE1ll\xEDt\xE1sok folyamat {expired_at_unix_since_minutes} perccel ezel\u0151tt lej\xE1rt, k\xE9rj\xFCk, pr\xF3b\xE1lja \xFAjra.",
  "identities.messages.4060001": "A k\xE9r\xE9s m\xE1r sikeresen befejez\u0151d\xF6tt \xE9s nem ism\xE9telhet\u0151 meg.",
  "identities.messages.4060002": "A helyre\xE1ll\xEDt\xE1si folyamat hib\xE1s \xE1llapotba ker\xFClt \xE9s meg kell ism\xE9telni.",
  "identities.messages.4060004": "A helyre\xE1ll\xEDt\xE1si token \xE9rv\xE9nytelen vagy m\xE1r haszn\xE1lt\xE1k. K\xE9rj\xFCk, ism\xE9telje meg a folyamatot.",
  "identities.messages.4060005": "A helyre\xE1ll\xEDt\xE1si folyamat {expired_at_unix_since_minutes} perccel ezel\u0151tt lej\xE1rt, k\xE9rj\xFCk, pr\xF3b\xE1lja \xFAjra.",
  "identities.messages.4060006": "A helyre\xE1ll\xEDt\xE1si k\xF3d \xE9rv\xE9nytelen vagy m\xE1r haszn\xE1lt\xE1k. K\xE9rj\xFCk, pr\xF3b\xE1lja \xFAjra.",
