  "identities.messages.4000006": "Nzere e nyere ad\u1ECBgh\u1ECB mma, lelee njehie nhazi n'okwuntughe g\u1ECB ma \u1ECD b\u1EE5 aha njirimara, adrees\u1ECB email, ma \u1ECD b\u1EE5 n\u1ECDmba ekwent\u1ECB.",
  "identities.messages.4000007": "Aka\u1EE5nt\u1EE5 nwere otu njirimara (email, ekwent\u1ECB, aha njirimara, ...) d\u1ECB ugbu a.",
  "identities.messages.4000008": "Koodu nch\u1ECDp\u1EE5ta e nyere ad\u1ECBgh\u1ECB mma, biko gbal\u1ECBa \u1ECDz\u1ECD.",
  "identities.messages.4000009": "Enwegh\u1ECB ike \u1ECBch\u1ECDta njirimara nbanye \u1ECD b\u1EE5la. \u1ECA chefuru \u1ECBt\u1ECD ha? Nke a nwekwara ike \u1ECBb\u1EE5 n'ihi nhazi sava na-ezighi ezi.",
  "identities.messages.4000010": "Aka\u1EE5nt\u1EE5 ar\u1EE5begh\u1ECB \u1ECDr\u1EE5. \u1ECA chefuru inyocha adrees\u1ECB email g\u1ECB?",
  "identities.messages.4000011": "\u1ECA nwegh\u1ECB ngwa\u1ECDr\u1EE5 TOTP edoziri.",
  "identities.messages.4000012": "E jirila koodu mweghachi ndabere a.",
  "identities.messages.4000013": "\u1ECA nwegh\u1ECB ngwa\u1ECDr\u1EE5 WebAuthn edoziri.",
  "identities.messages.4000014": "\u1ECA nwegh\u1ECB koodu mweghachi ndabere edoziri.",
  "identities.messages.4000015": "Aka\u1EE5nt\u1EE5 a ad\u1ECBgh\u1ECB ma \u1ECD b\u1EE5 \u1ECD nwegh\u1ECB igodo nchekwa edoziri.",
  "identities.messages.4000016": "Koodu mweghachi ndabere ad\u1ECBgh\u1ECB mma.",
  "identities.messages.4000017": "ogologo ga-ab\u1EE5r\u1ECBr\u1ECB <= {max_length}, mana enwetara {actual_length}",
  "identities.messages.4000018": "ga-ab\u1EE5r\u1ECBr\u1ECB >= {minimum} mana ach\u1ECDtara {actual}",
  "identities.messages.4000019": "ga-ab\u1EE5r\u1ECBr\u1ECB > {minimum} mana ach\u1ECDtara {actual}",
  "identities.messages.4000020": "ga-ab\u1EE5r\u1ECBr\u1ECB <= {maximum} mana ach\u1ECDtara {actual}",
  "identities.messages.4000021": "ga-ab\u1EE5r\u1ECBr\u1ECB < {maximum} mana ach\u1ECDtara {actual}",
  "identities.messages.4000022": "{actual} ab\u1EE5gh\u1ECB multipleOf {base}",
  "identities.messages.4000023": "ihe kacha nke {max_items} ka ekwere, mana ach\u1ECDtara ihe {actual_items}",
  "identities.messages.4000024": "ihe kacha nta nke {min_items} ka ekwere, mana ach\u1ECDtara ihe {actual_items}",
  "identities.messages.4000025": "ihe d\u1ECB na ndeksi {index_a} na {index_b} b\u1EE5 otu",
  "identities.messages.4000026": "a t\u1EE5r\u1EE5 anya {allowed_types_list}, mana enwetara {actual_type}",
  "identities.messages.4000027": "Aka\u1EE5nt\u1EE5 nwere otu njirimara (email, ekwent\u1ECB, aha njirimara, ...) d\u1ECB ugbu a. Biko banye na aka\u1EE5nt\u1EE5 g\u1ECB d\u1ECB ad\u1ECB iji jik\u1ECD\u1ECD profa\u1ECBl\u1EE5 mmek\u1ECDr\u1ECBta g\u1ECB.",
  "identities.messages.4000028": "\u1ECA gbal\u1ECBr\u1ECB \u1ECBbanye na {credential_identifier_hint} nke aka\u1EE5nt\u1EE5 \u1ECDz\u1ECD na-eji. \u1ECA nwere ike \u1ECBbanye site na iji {available_credential_types_list}. \u1ECA nwere ike \u1ECBbanye site na iji otu n'ime nd\u1ECB na-enye nbanye mmek\u1ECDr\u1ECBta nd\u1ECB a: {Available_oidc_providers_list}.",
  "identities.messages.4000029": "ga-aha ka \u1ECD b\u1EE5r\u1EE5 {expected}",
  "identities.messages.4000030": "const jebegh\u1ECB",
  "identities.messages.4000031": "Enwegh\u1ECB ike iji okwuntughe ah\u1EE5 n'ihi na \u1ECD yiri njirimara ah\u1EE5 nke ukwuu.",
  "identities.messages.4000032": "Okwuntughe ah\u1EE5 ga-ab\u1EE5r\u1ECBr\u1ECB opekata mpe mkp\u1EE5r\u1EE5edemede {min_length}, mana enwetara {actual_length}.",
  "identities.messages.4000033": "Okwuntughe ah\u1EE5 ga-ab\u1EE5r\u1ECBr\u1ECB opekata {max_length} mkp\u1EE5r\u1EE5edemede, mana enwetara {actual_length}.",
  "identities.messages.4000034": "Ach\u1ECDtala okwuntughe ah\u1EE5 na mmebi data ma ekwes\u1ECBgh\u1ECB iji ya \u1ECDz\u1ECD.",
  "identities.messages.4000035": "Aka\u1EE5nt\u1EE5 a ad\u1ECBgh\u1ECB ma \u1ECD b\u1EE5 \u1ECD habegh\u1ECB nbanye na koodu.",
  "identities.messages.4000036": "Njirimara e nyere adabagh\u1ECB njirimara ejik\u1ECDtara na mmeghar\u1ECB a na mb\u1EE5.",
  "identities.messages.4000037": "Aka\u1EE5nt\u1EE5 a ad\u1ECBgh\u1ECB ma \u1ECD b\u1EE5 \u1ECD nwegh\u1ECB usoro nbanye haziri.",
  "identities.messages.4000038": "Nch\u1ECDp\u1EE5ta Captcha jebegh\u1ECB, biko gbal\u1ECBa \u1ECDz\u1ECD.",
  "identities.messages.4010001": "Mmeghar\u1ECB nbanye kw\u1EE5s\u1ECBr\u1ECB nkeji {expired_at_unix_since_minutes} gara aga, biko gbal\u1ECBa \u1ECDz\u1ECD.",
  "identities.messages.4010002": "Enwegh\u1ECB ike \u1ECBch\u1ECDta at\u1EE5mat\u1EE5 iji banye g\u1ECB. \u1ECA mejuru mpempe akw\u1EE5kw\u1ECD ah\u1EE5 nke \u1ECDma?",
  "identities.messages.4010003": "Enwegh\u1ECB ike \u1ECBch\u1ECDta at\u1EE5mat\u1EE5 iji debanye g\u1ECB aha. \u1ECA mejuru mpempe akw\u1EE5kw\u1ECD ah\u1EE5 nke \u1ECDma?",
  "identities.messages.4010004": "Enwegh\u1ECB ike \u1ECBch\u1ECDta at\u1EE5mat\u1EE5 iji melite nt\u1ECDala g\u1ECB. \u1ECA mejuru mpempe akw\u1EE5kw\u1ECD ah\u1EE5 nke \u1ECDma?",
  "identities.messages.4010005": "Enwegh\u1ECB ike \u1ECBch\u1ECDta at\u1EE5mat\u1EE5 iji weghachi aka\u1EE5nt\u1EE5 g\u1ECB. \u1ECA mejuru mpempe akw\u1EE5kw\u1ECD ah\u1EE5 nke \u1ECDma?",
