  "identities.messages.4010007": "E mechara ar\u1ECBr\u1ECB\u1ECD ah\u1EE5 nke \u1ECDma ma enwegh\u1ECB ike \u1ECBgbal\u1ECBa \u1ECDz\u1ECD.",
