  "identities.messages.1010015": "\u10E8\u10D4\u10E1\u10D5\u10DA\u10D8\u10E1 \u10D9\u10DD\u10D3\u10D8\u10E1 \u10D2\u10D0\u10D2\u10D6\u10D0\u10D5\u10DC\u10D0",
