  "identities.messages.4000038": "Captcha \u10D2\u10D0\u10D3\u10D0\u10DB\u10DD\u10EC\u10DB\u10D4\u10D1\u10D0 \u10D5\u10D4\u10E0 \u10E8\u10D4\u10E1\u10E0\u10E3\u10DA\u10D3\u10D0, \u10D2\u10D7\u10EE\u10DD\u10D5\u10D7 \u10E1\u10EA\u10D0\u10D3\u10DD\u10D7 \u10EE\u10D4\u10DA\u10D0\u10EE\u10DA\u10D0.",
  "identities.messages.4010001": "\u10E8\u10D4\u10E1\u10D5\u10DA\u10D8\u10E1 \u10DC\u10D0\u10D9\u10D0\u10D3\u10D8 \u10D0\u10DB\u10DD\u10D8\u10EC\u10E3\u10E0\u10D0 {expired_at_unix_since_minutes} \u10EC\u10E3\u10D7\u10D8\u10E1 \u10EC\u10D8\u10DC, \u10D2\u10D7\u10EE\u10DD\u10D5\u10D7 \u10E1\u10EA\u10D0\u10D3\u10DD\u10D7 \u10EE\u10D4\u10DA\u10D0\u10EE\u10DA\u10D0.",
  "identities.messages.4010002": "\u10D5\u10D4\u10E0 \u10DB\u10DD\u10D8\u10EB\u10D4\u10D1\u10DC\u10D0 \u10E1\u10E2\u10E0\u10D0\u10E2\u10D4\u10D2\u10D8\u10D0 \u10D7\u10E5\u10D5\u10D4\u10DC\u10D8 \u10E8\u10D4\u10E1\u10D5\u10DA\u10D8\u10E1\u10D7\u10D5\u10D8\u10E1. \u10E1\u10EC\u10DD\u10E0\u10D0\u10D3 \u10E8\u10D4\u10D0\u10D5\u10E1\u10D4\u10D7 \u10E4\u10DD\u10E0\u10DB\u10D0?",
  "identities.messages.4010003": "\u10D5\u10D4\u10E0 \u10DB\u10DD\u10D8\u10EB\u10D4\u10D1\u10DC\u10D0 \u10E1\u10E2\u10E0\u10D0\u10E2\u10D4\u10D2\u10D8\u10D0 \u10D7\u10E5\u10D5\u10D4\u10DC\u10D8 \u10E0\u10D4\u10D2\u10D8\u10E1\u10E2\u10E0\u10D0\u10EA\u10D8\u10D8\u10E1\u10D7\u10D5\u10D8\u10E1. \u10E1\u10EC\u10DD\u10E0\u10D0\u10D3 \u10E8\u10D4\u10D0\u10D5\u10E1\u10D4\u10D7 \u10E4\u10DD\u10E0\u10DB\u10D0?",
  "identities.messages.4010004": "\u10D5\u10D4\u10E0 \u10DB\u10DD\u10D8\u10EB\u10D4\u10D1\u10DC\u10D0 \u10E1\u10E2\u10E0\u10D0\u10E2\u10D4\u10D2\u10D8\u10D0 \u10D7\u10E5\u10D5\u10D4\u10DC\u10D8 \u10DE\u10D0\u10E0\u10D0\u10DB\u10D4\u10E2\u10E0\u10D4\u10D1\u10D8\u10E1 \u10D2\u10D0\u10DC\u10D0\u10EE\u10DA\u10D4\u10D1\u10D8\u10E1\u10D7\u10D5\u10D8\u10E1. \u10E1\u10EC\u10DD\u10E0\u10D0\u10D3 \u10E8\u10D4\u10D0\u10D5\u10E1\u10D4\u10D7 \u10E4\u10DD\u10E0\u10DB\u10D0?",
  "identities.messages.4010005": "\u10D5\u10D4\u10E0 \u10DB\u10DD\u10D8\u10EB\u10D4\u10D1\u10DC\u10D0 \u10E1\u10E2\u10E0\u10D0\u10E2\u10D4\u10D2\u10D8\u10D0 \u10D7\u10E5\u10D5\u10D4\u10DC\u10D8 \u10D0\u10DC\u10D2\u10D0\u10E0\u10D8\u10E8\u10D8\u10E1 \u10D0\u10E6\u10D3\u10D2\u10D4\u10DC\u10D8\u10E1\u10D7\u10D5\u10D8\u10E1. \u10E1\u10EC\u10DD\u10E0\u10D0\u10D3 \u10E8\u10D4\u10D0\u10D5\u10E1\u10D4\u10D7 \u10E4\u10DD\u10E0\u10DB\u10D0?",
  "identities.messages.4010006": "\u10D5\u10D4\u10E0 \u10DB\u10DD\u10D8\u10EB\u10D4\u10D1\u10DC\u10D0 \u10E1\u10E2\u10E0\u10D0\u10E2\u10D4\u10D2\u10D8\u10D0 \u10D7\u10E5\u10D5\u10D4\u10DC\u10D8 \u10D0\u10DC\u10D2\u10D0\u10E0\u10D8\u10E8\u10D8\u10E1 \u10D2\u10D0\u10D3\u10D0\u10E1\u10D0\u10DB\u10DD\u10EC\u10DB\u10D4\u10D1\u10DA\u10D0\u10D3. \u10E1\u10EC\u10DD\u10E0\u10D0\u10D3 \u10E8\u10D4\u10D0\u10D5\u10E1\u10D4\u10D7 \u10E4\u10DD\u10E0\u10DB\u10D0?",
  "identities.messages.4010007": "\u10DB\u10DD\u10D7\u10EE\u10DD\u10D5\u10DC\u10D0 \u10E3\u10D9\u10D5\u10D4 \u10EC\u10D0\u10E0\u10DB\u10D0\u10E2\u10D4\u10D1\u10D8\u10D7 \u10E8\u10D4\u10E1\u10E0\u10E3\u10DA\u10D3\u10D0 \u10D3\u10D0 \u10D5\u10D4\u10E0 \u10D2\u10D0\u10DC\u10DB\u10D4\u10DD\u10E0\u10D3\u10D4\u10D1\u10D0.",
