  "identities.messages.4060002": "\u10D0\u10E6\u10D3\u10D2\u10D4\u10DC\u10D8\u10E1 \u10DC\u10D0\u10D9\u10D0\u10D3\u10DB\u10D0 \u10DB\u10D8\u10D0\u10E6\u10EC\u10D8\u10D0 \u10EC\u10D0\u10E0\u10E3\u10DB\u10D0\u10E2\u10D4\u10D1\u10D4\u10DA \u10DB\u10D3\u10D2\u10DD\u10DB\u10D0\u10E0\u10D4\u10DD\u10D1\u10D0\u10E1 \u10D3\u10D0 \u10E3\u10DC\u10D3\u10D0 \u10D2\u10D0\u10DC\u10DB\u10D4\u10DD\u10E0\u10D3\u10D4\u10E1.",
  "identities.messages.4060004": "\u10D0\u10E6\u10D3\u10D2\u10D4\u10DC\u10D8\u10E1 \u10E2\u10DD\u10D9\u10D4\u10DC\u10D8 \u10D0\u10E0\u10D0\u10E1\u10EC\u10DD\u10E0\u10D8\u10D0 \u10D0\u10DC \u10E3\u10D9\u10D5\u10D4 \u10D2\u10D0\u10DB\u10DD\u10E7\u10D4\u10DC\u10D4\u10D1\u10E3\u10DA\u10D8\u10D0. \u10D2\u10D7\u10EE\u10DD\u10D5\u10D7 \u10EE\u10D4\u10DA\u10D0\u10EE\u10DA\u10D0 \u10E1\u10EA\u10D0\u10D3\u10DD\u10D7 \u10DC\u10D0\u10D9\u10D0\u10D3\u10D8.",
  "identities.messages.4060005": "\u10D0\u10E6\u10D3\u10D2\u10D4\u10DC\u10D8\u10E1 \u10DC\u10D0\u10D9\u10D0\u10D3\u10D8 \u10D0\u10DB\u10DD\u10D8\u10EC\u10E3\u10E0\u10D0 {expired_at_unix_since_minutes} \u10EC\u10E3\u10D7\u10D8\u10E1 \u10EC\u10D8\u10DC, \u10D2\u10D7\u10EE\u10DD\u10D5\u10D7 \u10E1\u10EA\u10D0\u10D3\u10DD\u10D7 \u10EE\u10D4\u10DA\u10D0\u10EE\u10DA\u10D0.",
  "identities.messages.4060006": "\u10D0\u10E6\u10D3\u10D2\u10D4\u10DC\u10D8\u10E1 \u10D9\u10DD\u10D3\u10D8 \u10D0\u10E0\u10D0\u10E1\u10EC\u10DD\u10E0\u10D8\u10D0 \u10D0\u10DC \u10E3\u10D9\u10D5\u10D4 \u10D2\u10D0\u10DB\u10DD\u10E7\u10D4\u10DC\u10D4\u10D1\u10E3\u10DA\u10D8\u10D0. \u10D2\u10D7\u10EE\u10DD\u10D5\u10D7 \u10E1\u10EA\u10D0\u10D3\u10DD\u10D7 \u10EE\u10D4\u10DA\u10D0\u10EE\u10DA\u10D0.",
  "identities.messages.4070001": "\u10D2\u10D0\u10D3\u10D0\u10DB\u10DD\u10EC\u10DB\u10D4\u10D1\u10D8\u10E1 \u10E2\u10DD\u10D9\u10D4\u10DC\u10D8 \u10D0\u10E0\u10D0\u10E1\u10EC\u10DD\u10E0\u10D8\u10D0 \u10D0\u10DC \u10E3\u10D9\u10D5\u10D4 \u10D2\u10D0\u10DB\u10DD\u10E7\u10D4\u10DC\u10D4\u10D1\u10E3\u10DA\u10D8\u10D0. \u10D2\u10D7\u10EE\u10DD\u10D5\u10D7 \u10EE\u10D4\u10DA\u10D0\u10EE\u10DA\u10D0 \u10E1\u10EA\u10D0\u10D3\u10DD\u10D7 \u10DC\u10D0\u10D9\u10D0\u10D3\u10D8.",
  "identities.messages.4070002": "\u10DB\u10DD\u10D7\u10EE\u10DD\u10D5\u10DC\u10D0 \u10E3\u10D9\u10D5\u10D4 \u10EC\u10D0\u10E0\u10DB\u10D0\u10E2\u10D4\u10D1\u10D8\u10D7 \u10E8\u10D4\u10E1\u10E0\u10E3\u10DA\u10D3\u10D0 \u10D3\u10D0 \u10D5\u10D4\u10E0 \u10D2\u10D0\u10DC\u10DB\u10D4\u10DD\u10E0\u10D3\u10D4\u10D1\u10D0.",
