  "identities.messages.1010016": '\u0647\u06D5\u0648\u06B5\u062A \u062F\u0627 \u0628\u06D5 "{duplicateIdentifier}" \u0628\u0686\u06CC\u062A\u06D5 \u0698\u0648\u0648\u0631\u06D5\u0648\u06D5\u060C \u0628\u06D5\u06B5\u0627\u0645 \u0626\u06D5\u0648 \u0626\u06CC\u0645\u06D5\u06CC\u06B5\u06D5 \u067E\u06CE\u0634\u062A\u0631 \u0644\u06D5\u0644\u0627\u06CC\u06D5\u0646 \u0647\u06D5\u0698\u0645\u0627\u0631\u06CE\u06A9\u06CC \u062A\u0631\u06D5\u0648\u06D5 \u0628\u06D5\u06A9\u0627\u0631\u0647\u0627\u062A\u0648\u0648\u06D5. \u0628\u0686\u06C6\u0631\u06D5 \u0698\u0648\u0648\u0631\u06D5\u0648\u06D5 \u0628\u06C6 \u0647\u06D5\u0698\u0645\u0627\u0631\u06D5\u06A9\u06D5\u062A \u0628\u06D5 \u06CC\u06D5\u06A9\u06CE\u06A9 \u0644\u06D5\u0645 \u0647\u06D5\u06B5\u0628\u0698\u0627\u0631\u062F\u0627\u0646\u0627\u0646\u06D5\u06CC \u062E\u0648\u0627\u0631\u06D5\u0648\u06D5 \u0628\u06C6 \u0632\u06CC\u0627\u062F\u06A9\u0631\u062F\u0646\u06CC \u0647\u06D5\u0698\u0645\u0627\u0631\u06D5\u06A9\u06D5\u062A "{duplicateIdentifier}" \u0644\u06D5 "{provider}" \u0648\u06D5\u06A9 \u0634\u06CE\u0648\u06D5\u06CC\u06D5\u06A9\u06CC \u062A\u0631\u06CC \u0686\u0648\u0648\u0646\u06D5\u0698\u0648\u0648\u0631\u06D5\u0648\u06D5.',
