  "identities.messages.1010008": "\u0B39\u0B3E\u0B30\u0B4D\u0B21\u0B71\u0B47\u0B30 \u0B15\u0B3F \u0B38\u0B39\u0B3F\u0B24 \u0B1C\u0B3E\u0B30\u0B3F \u0B30\u0B16\u0B28\u0B4D\u0B24\u0B41",
