  "identities.messages.1010011": "\u0B39\u0B3E\u0B30\u0B4D\u0B21\u0B71\u0B47\u0B30 \u0B15\u0B3F \u0B38\u0B39\u0B3F\u0B24 \u0B38\u0B3E\u0B07\u0B28 \u0B07\u0B28 \u0B15\u0B30\u0B28\u0B4D\u0B24\u0B41",
  "identities.messages.1010012": "\u0B06\u0B2A\u0B23\u0B19\u0B4D\u0B15\u0B30 WebAuthn \u0B09\u0B2A\u0B15\u0B30\u0B23 (\u0B2F\u0B47\u0B2A\u0B30\u0B3F\u0B15\u0B3F \u0B38\u0B3F\u0B15\u0B4D\u0B5F\u0B41\u0B30\u0B3F\u0B1F\u0B3F \u0B15\u0B3F, \u0B2C\u0B3E\u0B5F\u0B4B\u0B2E\u0B47\u0B1F\u0B4D\u0B30\u0B3F\u0B15\u0B4D\u0B38 \u0B38\u0B4D\u0B15\u0B3E\u0B28\u0B30, ...) \u0B2A\u0B4D\u0B30\u0B38\u0B4D\u0B24\u0B41\u0B24 \u0B15\u0B30\u0B28\u0B4D\u0B24\u0B41 \u0B0F\u0B2C\u0B02 \u0B1C\u0B3E\u0B30\u0B3F \u0B30\u0B16\u0B28\u0B4D\u0B24\u0B41 \u0B26\u0B2C\u0B3E\u0B28\u0B4D\u0B24\u0B41\u0964",
  "identities.messages.1010013": "\u0B1C\u0B3E\u0B30\u0B3F \u0B30\u0B16\u0B28\u0B4D\u0B24\u0B41",
