  "error.instructions": "\u0A15\u0A3F\u0A30\u0A2A\u0A3E \u0A15\u0A30\u0A15\u0A47 \u0A15\u0A41\u0A1D \u0A2E\u0A3F\u0A70\u0A1F\u0A3E\u0A02 \u0A35\u0A3F\u0A71\u0A1A \u0A26\u0A41\u0A2C\u0A3E\u0A30\u0A3E \u0A15\u0A4B\u0A38\u0A3C\u0A3F\u0A38\u0A3C \u0A15\u0A30\u0A4B \u0A1C\u0A3E\u0A02 \u0A35\u0A48\u0A2C\u0A38\u0A3E\u0A08\u0A1F \u0A06\u0A2A\u0A30\u0A47\u0A1F\u0A30 \u0A28\u0A3E\u0A32 \u0A38\u0A70\u0A2A\u0A30\u0A15 \u0A15\u0A30\u0A4B\u0964",
