  "identities.messages.1060002": "\u062A\u0627\u0633\u0648 \u062A\u0647 \u0686\u06D0 \u0686\u0645\u062A\u0648 \u06A9\u0693\u06D0 \u0628\u0631\u06CC\u069A\u0646\u0627\u0644\u06CC\u06A9 \u0627\u062F\u0631\u0633 \u062A\u0647 \u06CC\u0648 \u0628\u0631\u06CC\u069A\u0646\u0627\u0644\u06CC\u06A9 \u0686\u06D0 \u067E\u0647 \u06A9\u06D0 \u062F \u0628\u06CC\u0627\u0631\u063A\u0648\u0646\u06D0 \u0644\u06CC\u0646\u06A9 \u0648\u064A \u0648\u0627\u0633\u062A\u0648\u0644 \u0634\u0648\u06CC \u062F\u06CC. \u06A9\u0647 \u062A\u0627\u0633\u0648 \u0628\u0631\u06CC\u069A\u0646\u0627\u0644\u06CC\u06A9 \u0646\u0647 \u0648\u0648 \u062A\u0631\u0644\u0627\u0633\u0647 \u06A9\u0693\u06CC\u060C \u062F \u0627\u062F\u0631\u0633 \u0633\u067E\u06CC\u0644\u0646\u06AB \u0648\u06AB\u0648\u0631\u0626 \u0627\u0648 \u0689\u0627\u0689 \u062A\u0631\u0644\u0627\u0633\u0647 \u06A9\u0693\u0626 \u0686\u06D0 \u0647\u063A\u0647 \u0627\u062F\u0631\u0633 \u06A9\u0627\u0631\u0648\u0626 \u0686\u06D0 \u062A\u0627\u0633\u0648 \u0648\u0631\u0633\u0631\u0647 \u0646\u0648\u0645 \u0644\u06CC\u06A9\u0646\u0647 \u06A9\u0693\u06D0 \u0648\u0647.",
