  "identities.messages.1010016": '\u0D94\u0DB6 "{duplicateIdentifier}" \u0DC3\u0DB8\u0D9F \u0DB4\u0DD4\u0DBB\u0DB1\u0DBA \u0DC0\u0DD3\u0DB8\u0DA7 \u0D8B\u0DAD\u0DCA\u0DC3\u0DCF\u0DC4 \u0D9A\u0DC5 \u0DB1\u0DB8\u0DD4\u0DAD\u0DCA \u0D91\u0DB8 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD \u0DC0\u0DD9\u0DB1\u0DAD\u0DCA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0D9A\u0DCA \u0DC0\u0DD2\u0DC3\u0DD2\u0DB1\u0DCA \u0DAF\u0DD0\u0DB1\u0DA7\u0DB8\u0DAD\u0DCA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DD4 \u0DBD\u0DD0\u0DB6\u0DDA. \u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8 "{duplicateIdentifier}" at "{provider}" \u0DB4\u0DD4\u0DBB\u0DB1\u0DBA \u0DC0\u0DD3\u0DB8\u0DA7 \u0DAD\u0DC0\u0DAD\u0DCA \u0D9A\u0DCA\u200D\u0DBB\u0DB8\u0DBA\u0D9A\u0DCA \u0DBD\u0DD9\u0DC3 \u0D91\u0D9A\u0DAD\u0DD4 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0DB4\u0DC4\u0DAD \u0DC0\u0DD2\u0D9A\u0DBD\u0DCA\u0DB4\u0DC0\u0DBD\u0DD2\u0DB1\u0DCA \u0D91\u0D9A\u0D9A\u0DCA \u0DC3\u0DB8\u0D9F \u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0DA7 \u0DB4\u0DD4\u0DBB\u0DB1\u0DBA \u0DC0\u0DB1\u0DCA\u0DB1.',
  "identities.messages.1010017": "\u0DB4\u0DD4\u0DBB\u0DB1\u0DBA \u0DC0\u0DD3 \u0DC3\u0DB8\u0DCA\u0DB6\u0DB1\u0DCA\u0DB0 \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1",
