  "identities.messages.1050010": "\u0DB8\u0DDA\u0DC0\u0DCF \u0D94\u0DB6\u0DDA \u0D8B\u0DB4\u0DC3\u0DCA\u0DAE \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1 \u0D9A\u0DDA\u0DAD \u0DC0\u0DDA. \u0D9A\u0DBB\u0DD4\u0DAB\u0DCF\u0D9A\u0DBB \u0D92\u0DC0\u0DCF \u0D86\u0DBB\u0D9A\u0DCA\u0DC2\u0DD2\u0DAD \u0DC3\u0DCA\u0DAE\u0DCF\u0DB1\u0DBA\u0D9A \u0DAD\u0DB6\u0DCF \u0D9C\u0DB1\u0DCA\u0DB1!",
