  "identities.messages.1050018": '\u0D86\u0DBB\u0D9A\u0DCA\u0DC2\u0D9A \u0DBA\u0DAD\u0DD4\u0DBB "{display_name}" \u0D89\u0DC0\u0DAD\u0DCA \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1',
