  "identities.messages.1060001": "\u0D94\u0DB6 \u0DC3\u0DCF\u0DBB\u0DCA\u0DAE\u0D9A\u0DC0 \u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8 \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1\u0DBA \u0D9A\u0DC5\u0DCF. \u0D9A\u0DBB\u0DD4\u0DAB\u0DCF\u0D9A\u0DBB \u0DB8\u0DD3\u0DC5\u0D9F {privileged_session_expires_at_unix_until_minutes} \u0DB8\u0DD2\u0DB1\u0DD2\u0DAD\u0DCA\u0DAD\u0DD4 \u0DAD\u0DD4\u0DC5 \u0D94\u0DB6\u0DDA \u0DB8\u0DD4\u0DBB\u0DB4\u0DAF\u0DBA \u0DC0\u0DD9\u0DB1\u0DC3\u0DCA \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1 \u0DC4\u0DDD \u0DC0\u0DD2\u0D9A\u0DBD\u0DCA\u0DB4 \u0DB4\u0DD2\u0DC0\u0DD2\u0DC3\u0DD4\u0DB8\u0DCA \u0D9A\u0DCA\u200D\u0DBB\u0DB8\u0DBA\u0D9A\u0DCA \u0DC3\u0D9A\u0DC3\u0DB1\u0DCA\u0DB1 (\u0D8B\u0DAF\u0DCF. \u0DC3\u0DB8\u0DCF\u0DA2 \u0DB4\u0DD4\u0DBB\u0DB1\u0DBA \u0DC0\u0DD3\u0DB8).",
  "identities.messages.1060002": "\u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1 \u0DC3\u0DB6\u0DD0\u0DB3\u0DD2\u0DBA\u0D9A\u0DCA \u0DC3\u0DC4\u0DD2\u0DAD \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0D9A\u0DCA \u0D94\u0DB6 \u0DC3\u0DB4\u0DBA\u0DCF \u0D87\u0DAD\u0DD2 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD0\u0DBD\u0DCA \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DA7 \u0DBA\u0DC0\u0DB1 \u0DBD\u0DAF\u0DD3. \u0D94\u0DB6\u0DA7 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0D9A\u0DCA \u0DBD\u0DD0\u0DB6\u0DD3 \u0DB1\u0DD0\u0DAD\u0DCA\u0DB1\u0DB8\u0DCA, \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DDA \u0D85\u0D9A\u0DCA\u0DC2\u0DBB \u0DC0\u0DD2\u0DB1\u0DCA\u200D\u0DBA\u0DCF\u0DC3\u0DBA \u0DB4\u0DBB\u0DD3\u0D9A\u0DCA\u0DC2\u0DCF \u0D9A\u0DBB \u0D94\u0DB6 \u0DBD\u0DD2\u0DBA\u0DCF\u0DB4\u0DAF\u0DD2\u0D82\u0DA0\u0DD2 \u0DC0\u0DD6 \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "identities.messages.1060003": "\u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1 \u0D9A\u0DDA\u0DAD\u0DBA\u0D9A\u0DCA \u0DC3\u0DC4\u0DD2\u0DAD \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0D9A\u0DCA \u0D94\u0DB6 \u0DC3\u0DB4\u0DBA\u0DCF \u0D87\u0DAD\u0DD2 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD0\u0DBD\u0DCA \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DA7 \u0DBA\u0DC0\u0DB1 \u0DBD\u0DAF\u0DD3. \u0D94\u0DB6\u0DA7 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0D9A\u0DCA \u0DBD\u0DD0\u0DB6\u0DD3 \u0DB1\u0DD0\u0DAD\u0DCA\u0DB1\u0DB8\u0DCA, \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DDA \u0D85\u0D9A\u0DCA\u0DC2\u0DBB \u0DC0\u0DD2\u0DB1\u0DCA\u200D\u0DBA\u0DCF\u0DC3\u0DBA \u0DB4\u0DBB\u0DD3\u0D9A\u0DCA\u0DC2\u0DCF \u0D9A\u0DBB \u0D94\u0DB6 \u0DBD\u0DD2\u0DBA\u0DCF\u0DB4\u0DAF\u0DD2\u0D82\u0DA0\u0DD2 \u0DC0\u0DD6 \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "identities.messages.1060004": '"{masked_address}" \u0DC0\u0DD9\u0DAD \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1 \u0D9A\u0DDA\u0DAD\u0DBA\u0D9A\u0DCA \u0DBA\u0DC0\u0DB1 \u0DBD\u0DAF\u0DD3. \u0D94\u0DB6\u0DA7 \u0D91\u0DBA \u0DBD\u0DD0\u0DB6\u0DD3 \u0DB1\u0DD0\u0DAD\u0DCA\u0DB1\u0DB8\u0DCA, \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DDA \u0D85\u0D9A\u0DCA\u0DC2\u0DBB \u0DC0\u0DD2\u0DB1\u0DCA\u200D\u0DBA\u0DCF\u0DC3\u0DBA \u0DB4\u0DBB\u0DD3\u0D9A\u0DCA\u0DC2\u0DCF \u0D9A\u0DBB \u0D94\u0DB6 \u0DBD\u0DD2\u0DBA\u0DCF\u0DB4\u0DAF\u0DD2\u0D82\u0DA0\u0DD2 \u0DC0\u0DD6 \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.',
  "identities.messages.1060005": "\u0D94\u0DB6\u0DDA \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1 \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA \u0DC3\u0DB8\u0DCA\u0DB4\u0DD6\u0DBB\u0DCA\u0DAB\u0DBA\u0DD9\u0DB1\u0DCA \u0DC3\u0DB4\u0DBA\u0DCF \u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8 \u0DC0\u0DD9\u0DAD \u0DB4\u0DCA\u200D\u0DBB\u0DC0\u0DDA\u0DC1\u0DBA \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1\u0DBA \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "identities.messages.1060006": "\u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8 \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1\u0DBA \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0D94\u0DB6\u0DA7 \u0D85\u0DC0\u0DC1\u0DCA\u200D\u0DBA \u0D9A\u0DD9\u0DC3\u0DDA\u0DAF?",
  "identities.messages.1060007": "\u0D86\u0DB4\u0DC3\u0DD4",
