  "identities.messages.1070013": "\u0DB4\u0DD4\u0DBB\u0DB1 \u0D9A\u0DDA\u0DAD\u0DBA",
  "identities.messages.1070014": "\u0DB4\u0DD4\u0DBB\u0DB1\u0DBA \u0DC0\u0DD3 \u0D85\u0D9A\u0DCA\u0DAD\u0DB4\u0DAD\u0DCA\u200D\u0DBB\u0DBA \u0DC3\u0DB8\u0DCA\u0DB6\u0DB1\u0DCA\u0DB0 \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1",
