  "identities.messages.1070017": "\u0DAF\u0DD4\u0DBB\u0D9A\u0DAE\u0DB1 \u0D85\u0D82\u0D9A\u0DBA",
  "identities.messages.1080001": "\u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1 \u0DC3\u0DB6\u0DD0\u0DB3\u0DD2\u0DBA\u0D9A\u0DCA \u0DC3\u0DC4\u0DD2\u0DAD \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0D9A\u0DCA \u0D94\u0DB6 \u0DC3\u0DB4\u0DBA\u0DCF \u0D87\u0DAD\u0DD2 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD0\u0DBD\u0DCA \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DA7 \u0DBA\u0DC0\u0DB1 \u0DBD\u0DAF\u0DD3. \u0D94\u0DB6\u0DA7 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0D9A\u0DCA \u0DBD\u0DD0\u0DB6\u0DD3 \u0DB1\u0DD0\u0DAD\u0DCA\u0DB1\u0DB8\u0DCA, \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DDA \u0D85\u0D9A\u0DCA\u0DC2\u0DBB \u0DC0\u0DD2\u0DB1\u0DCA\u200D\u0DBA\u0DCF\u0DC3\u0DBA \u0DB4\u0DBB\u0DD3\u0D9A\u0DCA\u0DC2\u0DCF \u0D9A\u0DBB \u0D94\u0DB6 \u0DBD\u0DD2\u0DBA\u0DCF\u0DB4\u0DAF\u0DD2\u0D82\u0DA0\u0DD2 \u0DC0\u0DD6 \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "identities.messages.1080002": "\u0D94\u0DB6 \u0DC3\u0DCF\u0DBB\u0DCA\u0DAE\u0D9A\u0DC0 \u0D94\u0DB6\u0DDA \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD0\u0DBD\u0DCA \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA \u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1\u0DBA \u0D9A\u0DC5\u0DCF.",
  "identities.messages.1080003": "\u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1 \u0D9A\u0DDA\u0DAD\u0DBA\u0D9A\u0DCA \u0DC3\u0DC4\u0DD2\u0DAD \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0D9A\u0DCA \u0D94\u0DB6 \u0DC3\u0DB4\u0DBA\u0DCF \u0D87\u0DAD\u0DD2 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD0\u0DBD\u0DCA \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DA7 \u0DBA\u0DC0\u0DB1 \u0DBD\u0DAF\u0DD3. \u0D94\u0DB6\u0DA7 \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0D9A\u0DCA \u0DBD\u0DD0\u0DB6\u0DD3 \u0DB1\u0DD0\u0DAD\u0DCA\u0DB1\u0DB8\u0DCA, \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA\u0DDA \u0D85\u0D9A\u0DCA\u0DC2\u0DBB \u0DC0\u0DD2\u0DB1\u0DCA\u200D\u0DBA\u0DCF\u0DC3\u0DBA \u0DB4\u0DBB\u0DD3\u0D9A\u0DCA\u0DC2\u0DCF \u0D9A\u0DBB \u0D94\u0DB6 \u0DBD\u0DD2\u0DBA\u0DCF\u0DB4\u0DAF\u0DD2\u0D82\u0DA0\u0DD2 \u0DC0\u0DD6 \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "identities.messages.4000001": "{reason}",
  "identities.messages.4000002": "\u0D9A\u0DBB\u0DD4\u0DAB\u0DCF\u0D9A\u0DBB {property} \u0D87\u0DAD\u0DD4\u0DC5\u0DAD\u0DCA \u0D9A\u0DBB \u0DB1\u0DD0\u0DC0\u0DAD \u0D8B\u0DAD\u0DCA\u0DC3\u0DCF\u0DC4 \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "identities.messages.4000003": "\u0DAF\u0DD2\u0D9C >= {min_length} \u0DC0\u0DD2\u0DBA \u0DBA\u0DD4\u0DAD\u0DD4\u0DBA, \u0DB1\u0DB8\u0DD4\u0DAD\u0DCA {actual_length} \u0DBD\u0DD0\u0DB6\u0DD4\u0DAB\u0DD2",
  "identities.messages.4000004": '"{pattern}" \u0DBB\u0DA7\u0DCF\u0DC0\u0DA7 \u0DB1\u0DDC\u0D9C\u0DD0\u0DBD\u0DB4\u0DDA',
