  "identities.messages.4000006": "\u0DC3\u0DB4\u0DBA\u0DCF \u0D87\u0DAD\u0DD2 \u0D85\u0D9A\u0DCA\u0DAD\u0DB4\u0DAD\u0DCA\u200D\u0DBB \u0DC0\u0DBD\u0D82\u0D9C\u0DD4 \u0DB1\u0DD0\u0DAD, \u0D94\u0DB6\u0DDA \u0DB8\u0DD4\u0DBB\u0DB4\u0DAF\u0DBA \u0DC4\u0DDD \u0DB4\u0DBB\u0DD2\u0DC1\u0DD3\u0DBD\u0D9A \u0DB1\u0DCF\u0DB8\u0DBA, \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD0\u0DBD\u0DCA \u0DBD\u0DD2\u0DB4\u0DD2\u0DB1\u0DBA \u0DC4\u0DDD \u0DAF\u0DD4\u0DBB\u0D9A\u0DAE\u0DB1 \u0D85\u0D82\u0D9A\u0DBA\u0DD9\u0DC4\u0DD2 \u0D85\u0D9A\u0DCA\u0DC2\u0DBB \u0DC0\u0DD2\u0DB1\u0DCA\u200D\u0DBA\u0DCF\u0DC3 \u0DC0\u0DD0\u0DBB\u0DAF\u0DD2 \u0DB4\u0DBB\u0DD3\u0D9A\u0DCA\u0DC2\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "identities.messages.4000007": "\u0D91\u0D9A\u0DB8 \u0DC4\u0DB3\u0DD4\u0DB1\u0DCF\u0D9C\u0DD0\u0DB1\u0DD3\u0DB8 \u0DC3\u0DC4\u0DD2\u0DAD \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0D9A\u0DCA (\u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD, \u0DAF\u0DD4\u0DBB\u0D9A\u0DAE\u0DB1\u0DBA, \u0DB4\u0DBB\u0DD2\u0DC1\u0DD3\u0DBD\u0D9A \u0DB1\u0DCF\u0DB8\u0DBA, ...) \u0DAF\u0DD0\u0DB1\u0DA7\u0DB8\u0DAD\u0DCA \u0DB4\u0DC0\u0DAD\u0DD3.",
