  "two-step.code.description": "\u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1 \u0D9A\u0DDA\u0DAD\u0DBA\u0D9A\u0DCA \u0D94\u0DB6\u0DDA \u0DC0\u0DD2\u0DAF\u0DCA\u200D\u0DBA\u0DD4\u0DAD\u0DCA \u0DAD\u0DD0\u0DB4\u0DD1\u0DBD\u0DA7 \u0DBA\u0DC0\u0DB1\u0DD4 \u0DBD\u0DD0\u0DB6\u0DDA",
  "two-step.webauthn.title": "\u0D86\u0DBB\u0D9A\u0DCA\u0DC2\u0D9A \u0DBA\u0DAD\u0DD4\u0DBB",
  "two-step.webauthn.description": "\u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1\u0DBA \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0D94\u0DB6\u0DDA \u0D86\u0DBB\u0D9A\u0DCA\u0DC2\u0D9A \u0DBA\u0DAD\u0DD4\u0DBB \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1",
  "two-step.passkey.title": "Passkey (\u0DB1\u0DD2\u0DBB\u0DCA\u0DAF\u0DDA\u0DC1\u0DD2\u0DAD)",
