  "two-step.passkey.description.error": "\u0D94\u0DB6\u0DDA Passkey \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0D85\u0DC0\u0DC1\u0DCA\u200D\u0DBA \u0DB4\u0DD4\u0DC3\u0DCA\u0DAD\u0D9A\u0DCF\u0DBD \u0DB4\u0DD6\u0DBB\u0DAB\u0DBA \u0D9A\u0DC5 \u0DB1\u0DDC\u0DC4\u0DD0\u0D9A\u0DD2 \u0DC0\u0DD2\u0DBA. \u0D9A\u0DBB\u0DD4\u0DAB\u0DCF\u0D9A\u0DBB \u0DB4\u0DC3\u0DD4\u0DC0 \u0DB1\u0DD0\u0DC0\u0DAD \u0D8B\u0DAD\u0DCA\u0DC3\u0DCF\u0DC4 \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "two-step.totp.title": "\u0D94\u0DB6\u0DDA \u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1 \u0DBA\u0DD9\u0DAF\u0DD4\u0DB8 \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1 (TOTP)",
  "two-step.totp.description": "\u0D94\u0DB6\u0DDA \u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1 \u0DBA\u0DD9\u0DAF\u0DD4\u0DB8\u0DD9\u0DB1\u0DCA 6-\u0D89\u0DBD\u0D9A\u0DCA\u0D9A\u0DB8\u0DCA \u0D91\u0D9A\u0DCA \u0DC0\u0DBB \u0D9A\u0DDA\u0DAD\u0DBA\u0D9A\u0DCA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1",
  "two-step.lookup_secret.title": "\u0D8B\u0DB4\u0DC3\u0DCA\u0DAE \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1 \u0D9A\u0DDA\u0DAD\u0DBA",
  "two-step.lookup_secret.description": "\u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1\u0DBA \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0D94\u0DB6\u0DDA 8-\u0D89\u0DBD\u0D9A\u0DCA\u0D9A\u0DB8\u0DCA \u0D8B\u0DB4\u0DC3\u0DCA\u0DAE \u0D9A\u0DDA\u0DAD \u0DC0\u0DBD\u0DD2\u0DB1\u0DCA \u0D91\u0D9A\u0D9A\u0DCA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1",
