  "settings.totp.title": "\u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1 \u0DBA\u0DD9\u0DAF\u0DD4\u0DB8",
  "settings.totp.description": "\u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0DCA \u0D86\u0DBB\u0D9A\u0DCA\u0DC2\u0DCF\u0DC0 \u0DC0\u0DD0\u0DA9\u0DD2\u0DAF\u0DD2\u0DBA\u0DD4\u0DAB\u0DD4 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0DA7 TOTP \u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1 \u0DBA\u0DD9\u0DAF\u0DD4\u0DB8\u0D9A\u0DCA \u0D91\u0D9A\u0DCA \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1. \u0DA2\u0DB1\u0DB4\u0DCA\u200D\u0DBB\u0DD2\u0DBA \u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0DB1 \u0DBA\u0DD9\u0DAF\u0DD4\u0DB8\u0DCA \u0DC0\u0DB1\u0DCA\u0DB1\u0DDA LastPass \u0DC3\u0DC4 Google Authenticator \u0DBA",
  "settings.totp.info.not-linked": "\u0DC3\u0D9A\u0DCA\u200D\u0DBB\u0DD2\u0DBA \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0D94\u0DB6\u0DDA \u0DC3\u0DAD\u0DCA\u200D\u0DBA\u0DCF\u0DB4\u0D9A\u0DBA \u0DC3\u0DB8\u0D9F QR \u0D9A\u0DDA\u0DAD\u0DBA \u0DB4\u0DBB\u0DD2\u0DBD\u0DDD\u0D9A\u0DB1\u0DBA \u0D9A\u0DBB \u0D9A\u0DDA\u0DAD\u0DBA \u0D87\u0DAD\u0DD4\u0DC5\u0DAD\u0DCA \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
