  "settings.lookup_secret.title": "\u0D8B\u0DB4\u0DC3\u0DCA\u0DAE \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1 \u0D9A\u0DDA\u0DAD (\u0DAF\u0DD9\u0DC0\u0DB1 \u0DC3\u0DCF\u0DB0\u0D9A\u0DBA)",
  "settings.lookup_secret.description": "\u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DC3\u0DCF\u0DB0\u0DB1 \u0D9A\u0DDA\u0DAD 2FA \u0DC3\u0DB3\u0DC4\u0DCF \u0D86\u0DBB\u0D9A\u0DCA\u0DC2\u0DD2\u0DAD \u0D8B\u0DB4\u0DC3\u0DCA\u0DAE\u0DBA\u0D9A\u0DD2, \u0D94\u0DB6\u0DA7 \u0D94\u0DB6\u0DDA 2FA \u0D8B\u0DB4\u0DCF\u0D82\u0D9C\u0DBA \u0DB1\u0DD0\u0DAD\u0DD2 \u0DC0\u0DD4\u0DC0\u0DC4\u0DDC\u0DAD\u0DCA \u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0DA7 \u0DB1\u0DD0\u0DC0\u0DAD \u0DB4\u0DCA\u200D\u0DBB\u0DC0\u0DDA\u0DC1 \u0DC0\u0DD3\u0DB8\u0DA7 \u0D94\u0DB6\u0DA7 \u0D89\u0DA9 \u0DC3\u0DBD\u0DC3\u0DBA\u0DD2.",
  "settings.oidc.title": "\u0DC3\u0DB8\u0DCA\u0DB6\u0DB1\u0DCA\u0DB0\u0DD2\u0DAD \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0DCA",
  "settings.oidc.description": "\u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8 \u0DC3\u0DB8\u0D9F \u0DC3\u0DB8\u0DCF\u0DA2 \u0DB4\u0DD2\u0DC0\u0DD2\u0DC3\u0DD4\u0DB8\u0DCA \u0DC3\u0DD0\u0DB4\u0DBA\u0DD4\u0DB8\u0DCA\u0D9A\u0DBB\u0DD4\u0DC0\u0DD9\u0D9A\u0DD4 \u0DC3\u0DB8\u0DCA\u0DB6\u0DB1\u0DCA\u0DB0 \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1.",
  "settings.oidc.info": "\u0DB8\u0DD9\u0DB8 \u0DC3\u0DD0\u0DB4\u0DBA\u0DD4\u0DB8\u0DCA\u0D9A\u0DBB\u0DD4\u0DC0\u0DB1\u0DCA\u0D9C\u0DD9\u0DB1\u0DCA \u0DC3\u0DB8\u0DCA\u0DB6\u0DB1\u0DCA\u0DB0\u0DD2\u0DAD \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0DCA \u0D94\u0DB6\u0DDA \u0D9C\u0DD2\u0DAB\u0DD4\u0DB8\u0DA7 \u0DB4\u0DD4\u0DBB\u0DB1\u0DBA \u0DC0\u0DD3\u0DB8\u0DA7 \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DCF \u0D9A\u0DC5 \u0DC4\u0DD0\u0D9A",
