  "consent.scope.offline_access.title": "\u0DB1\u0DDC\u0DB6\u0DD0\u0DB3\u0DD2 \u0DB4\u0DCA\u200D\u0DBB\u0DC0\u0DDA\u0DC1\u0DBA",
