  "identities.messages.1060001": "\u0428\u0443\u043C\u043E \u04B3\u0438\u0441\u043E\u0431\u0438 \u0445\u0443\u0434\u0440\u043E \u0431\u043E\u043C\u0443\u0432\u0430\u0444\u0444\u0430\u049B\u0438\u044F\u0442 \u0431\u0430\u0440\u049B\u0430\u0440\u043E\u0440 \u043A\u0430\u0440\u0434\u0435\u0434. \u041B\u0443\u0442\u0444\u0430\u043D \u0440\u0430\u043C\u0437\u0438 \u0443\u0431\u0443\u0440\u0438 \u0445\u0443\u0434\u0440\u043E \u0434\u0430\u0440 \u0434\u0430\u0432\u043E\u043C\u0438 {privileged_session_expires_at_unix_until_minutes} \u0434\u0430\u049B\u0438\u049B\u0430\u0438 \u043E\u044F\u043D\u0434\u0430 \u0438\u0432\u0430\u0437 \u043A\u0443\u043D\u0435\u0434 \u0451 \u0443\u0441\u0443\u043B\u0438 \u0432\u0443\u0440\u0443\u0434\u0438 \u0430\u043B\u0442\u0435\u0440\u043D\u0430\u0442\u0438\u0432\u04E3 (\u043C\u0430\u0441\u0430\u043B\u0430\u043D, \u0432\u0443\u0440\u0443\u0434 \u0431\u043E \u0448\u0430\u0431\u0430\u043A\u0430\u04B3\u043E\u0438 \u0438\u04B7\u0442\u0438\u043C\u043E\u04E3) \u0442\u0430\u043D\u0437\u0438\u043C \u043A\u0443\u043D\u0435\u0434.",
  "identities.messages.1060002": "\u041F\u043E\u0447\u0442\u0430\u0438 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u04E3, \u043A\u0438 \u0434\u043E\u0440\u043E\u0438 \u043F\u0430\u0439\u0432\u0430\u043D\u0434\u0438 \u0431\u0430\u0440\u049B\u0430\u0440\u043E\u0440\u0441\u043E\u0437\u04E3 \u0430\u0441\u0442, \u0431\u0430 \u0441\u0443\u0440\u043E\u0493\u0430\u0438 \u043F\u043E\u0447\u0442\u0430\u0438 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u04E3, \u043A\u0438 \u0448\u0443\u043C\u043E \u0434\u043E\u0434\u0430 \u0431\u0443\u0434\u0435\u0434, \u0444\u0438\u0440\u0438\u0441\u0442\u043E\u0434\u0430 \u0448\u0443\u0434. \u0410\u0433\u0430\u0440 \u043F\u043E\u0447\u0442\u0430\u0440\u043E \u043D\u0430\u0433\u0438\u0440\u0438\u0444\u0442\u0430 \u0431\u043E\u0448\u0435\u0434, \u0438\u043C\u043B\u043E\u0438 \u0441\u0443\u0440\u043E\u0493\u0430\u0440\u043E \u0441\u0430\u043D\u04B7\u0435\u0434 \u0432\u0430 \u0431\u043E\u0432\u0430\u0440\u04E3 \u04B3\u043E\u0441\u0438\u043B \u043A\u0443\u043D\u0435\u0434, \u043A\u0438 \u0441\u0443\u0440\u043E\u0493\u0430\u0435 \u0438\u0441\u0442\u0438\u0444\u043E\u0434\u0430 \u043C\u0435\u0431\u0430\u0440\u0435\u0434, \u043A\u0438 \u0431\u043E \u043E\u043D \u0431\u0430\u049B\u0430\u0439\u0434\u0433\u0438\u0440\u04E3 \u0448\u0443\u0434\u0430 \u0431\u0443\u0434\u0435\u0434.",
  "identities.messages.1060003": "\u041F\u043E\u0447\u0442\u0430\u0438 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u04E3, \u043A\u0438 \u0434\u043E\u0440\u043E\u0438 \u0440\u0430\u043C\u0437\u0438 \u0431\u0430\u0440\u049B\u0430\u0440\u043E\u0440\u0441\u043E\u0437\u04E3 \u0430\u0441\u0442, \u0431\u0430 \u0441\u0443\u0440\u043E\u0493\u0430\u0438 \u043F\u043E\u0447\u0442\u0430\u0438 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u04E3, \u043A\u0438 \u0448\u0443\u043C\u043E \u0434\u043E\u0434\u0430 \u0431\u0443\u0434\u0435\u0434, \u0444\u0438\u0440\u0438\u0441\u0442\u043E\u0434\u0430 \u0448\u0443\u0434. \u0410\u0433\u0430\u0440 \u043F\u043E\u0447\u0442\u0430\u0440\u043E \u043D\u0430\u0433\u0438\u0440\u0438\u0444\u0442\u0430 \u0431\u043E\u0448\u0435\u0434, \u0438\u043C\u043B\u043E\u0438 \u0441\u0443\u0440\u043E\u0493\u0430\u0440\u043E \u0441\u0430\u043D\u04B7\u0435\u0434 \u0432\u0430 \u0431\u043E\u0432\u0430\u0440\u04E3 \u04B3\u043E\u0441\u0438\u043B \u043A\u0443\u043D\u0435\u0434, \u043A\u0438 \u0441\u0443\u0440\u043E\u0493\u0430\u0435 \u0438\u0441\u0442\u0438\u0444\u043E\u0434\u0430 \u043C\u0435\u0431\u0430\u0440\u0435\u0434, \u043A\u0438 \u0431\u043E \u043E\u043D \u0431\u0430\u049B\u0430\u0439\u0434\u0433\u0438\u0440\u04E3 \u0448\u0443\u0434\u0430 \u0431\u0443\u0434\u0435\u0434.",
  "identities.messages.1060004": '\u0420\u0430\u043C\u0437\u0438 \u0431\u0430\u0440\u049B\u0430\u0440\u043E\u0440\u0441\u043E\u0437\u04E3 \u0431\u0430 "{masked_address}" \u0444\u0438\u0440\u0438\u0441\u0442\u043E\u0434\u0430 \u0448\u0443\u0434. \u0410\u0433\u0430\u0440 \u0448\u0443\u043C\u043E \u043E\u043D\u0440\u043E \u043D\u0430\u0433\u0438\u0440\u0438\u0444\u0442\u0430 \u0431\u043E\u0448\u0435\u0434, \u0438\u043C\u043B\u043E\u0438 \u0441\u0443\u0440\u043E\u0493\u0430\u0440\u043E \u0441\u0430\u043D\u04B7\u0435\u0434 \u0432\u0430 \u0431\u043E\u0432\u0430\u0440\u04E3 \u04B3\u043E\u0441\u0438\u043B \u043A\u0443\u043D\u0435\u0434, \u043A\u0438 \u0441\u0443\u0440\u043E\u0493\u0430\u0435 \u0438\u0441\u0442\u0438\u0444\u043E\u0434\u0430 \u043C\u0435\u0431\u0430\u0440\u0435\u0434, \u043A\u0438 \u0431\u043E \u043E\u043D \u0431\u0430\u049B\u0430\u0439\u0434\u0433\u0438\u0440\u04E3 \u0448\u0443\u0434\u0430 \u0431\u0443\u0434\u0435\u0434.',
