  "identities.messages.1080001": "\u041F\u043E\u0447\u0442\u0430\u0438 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u04E3, \u043A\u0438 \u0434\u043E\u0440\u043E\u0438 \u043F\u0430\u0439\u0432\u0430\u043D\u0434\u0438 \u0442\u0430\u0441\u0434\u0438\u049B\u04E3 \u0430\u0441\u0442, \u0431\u0430 \u0441\u0443\u0440\u043E\u0493\u0430\u0438 \u043F\u043E\u0447\u0442\u0430\u0438 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u04E3, \u043A\u0438 \u0448\u0443\u043C\u043E \u0434\u043E\u0434\u0430 \u0431\u0443\u0434\u0435\u0434, \u0444\u0438\u0440\u0438\u0441\u0442\u043E\u0434\u0430 \u0448\u0443\u0434. \u0410\u0433\u0430\u0440 \u043F\u043E\u0447\u0442\u0430\u0440\u043E \u043D\u0430\u0433\u0438\u0440\u0438\u0444\u0442\u0430 \u0431\u043E\u0448\u0435\u0434, \u0438\u043C\u043B\u043E\u0438 \u0441\u0443\u0440\u043E\u0493\u0430\u0440\u043E \u0441\u0430\u043D\u04B7\u0435\u0434 \u0432\u0430 \u0431\u043E\u0432\u0430\u0440\u04E3 \u04B3\u043E\u0441\u0438\u043B \u043A\u0443\u043D\u0435\u0434, \u043A\u0438 \u0441\u0443\u0440\u043E\u0493\u0430\u0435 \u0438\u0441\u0442\u0438\u0444\u043E\u0434\u0430 \u043C\u0435\u0431\u0430\u0440\u0435\u0434, \u043A\u0438 \u0431\u043E \u043E\u043D \u0431\u0430\u049B\u0430\u0439\u0434\u0433\u0438\u0440\u04E3 \u0448\u0443\u0434\u0430 \u0431\u0443\u0434\u0435\u0434.",
  "identities.messages.1080002": "\u0428\u0443\u043C\u043E \u0441\u0443\u0440\u043E\u0493\u0430\u0438 \u043F\u043E\u0447\u0442\u0430\u0438 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u0438\u0438 \u0445\u0443\u0434\u0440\u043E \u0431\u043E\u043C\u0443\u0432\u0430\u0444\u0444\u0430\u049B\u0438\u044F\u0442 \u0442\u0430\u0441\u0434\u0438\u049B \u043A\u0430\u0440\u0434\u0435\u0434.",
