  "identities.messages.4000006": "\u041C\u0430\u044A\u043B\u0443\u043C\u043E\u0442\u0438 \u043F\u0435\u0448\u043D\u0438\u04B3\u043E\u0434\u0448\u0443\u0434\u0430 \u043D\u043E\u0434\u0443\u0440\u0443\u0441\u0442 \u0430\u0441\u0442, \u0445\u0430\u0442\u043E\u04B3\u043E\u0438 \u0438\u043C\u043B\u043E\u0438\u0440\u043E \u0434\u0430\u0440 \u0440\u0430\u043C\u0437\u0438 \u0443\u0431\u0443\u0440 \u0451 \u043D\u043E\u043C\u0438 \u043A\u043E\u0440\u0431\u0430\u0440\u04E3, \u0441\u0443\u0440\u043E\u0493\u0430\u0438 \u043F\u043E\u0447\u0442\u0430\u0438 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u04E3 \u0451 \u0440\u0430\u049B\u0430\u043C\u0438 \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u0438 \u0445\u0443\u0434 \u0441\u0430\u043D\u04B7\u0435\u0434.",
