  "consent.scope.openid.title": "\u0428\u0430\u0445\u0441\u0438\u044F\u0442",
  "consent.scope.openid.description": "\u0411\u0430 \u0431\u0430\u0440\u043D\u043E\u043C\u0430 \u0438\u043C\u043A\u043E\u043D \u043C\u0435\u0434\u0438\u04B3\u0430\u0434 \u0448\u0430\u0445\u0441\u0438\u044F\u0442\u0438 \u0448\u0443\u043C\u043E\u0440\u043E \u0442\u0430\u0441\u0434\u0438\u049B \u043A\u0443\u043D\u0430\u0434. \u0418\u043D \u0431\u0430\u0440\u043E\u0438 \u0430\u0443\u0442\u0435\u043D\u0442\u0438\u0444\u0438\u043A\u0430\u0442\u0441\u0438\u044F \u0432\u0430 \u0442\u0430\u04B7\u0440\u0438\u0431\u0430\u0438 \u0432\u0443\u0440\u0443\u0434\u0438 \u0431\u043E\u044D\u044A\u0442\u0438\u043C\u043E\u0434 \u0437\u0430\u0440\u0443\u0440 \u0430\u0441\u0442.",
