  "identities.messages.4000007": "\u015Eol bir kesgitle\xFDji (e-po\xE7ta, telefon, ulanyjy ady, ...) bolan hasap e\xFD\xFD\xE4m bar.",
  "identities.messages.4000008": "Berlen tassyklama kody n\xE4dogry, ha\xFDy\u015F ed\xFD\xE4ris t\xE4zeden synany\u015Fy\u0148.",
  "identities.messages.4000009": "Hi\xE7 bir giri\u015F kesgitle\xFDjisi tapylmady. Olary go\xFDmagy unutdy\u0148yzmy? Bu serwer \xFDal\u0148y\u015F konfigurasi\xFDasy seb\xE4pli hem bolup biler.",
