  "identities.messages.4000011": "Sizi\u0148 TOTP enjamy\u0148yz \xFDok.",
  "identities.messages.4000012": "Bu \xE4ti\xFDa\xE7lyk dikeltme kody e\xFD\xFD\xE4m ulanyldy.",
