  "identities.messages.4000028": "Siz {credential_identifier_hint} arkaly girm\xE4ge synany\u015Fdy\u0148yz, bu e\xFD\xFD\xE4m ba\u015Fga hasap tarapyndan ulanyl\xFDar. Siz {available_credential_types_list} ulanyp girip bilersi\u0148iz. A\u015Fakdaky sosial giri\u015F \xFCpj\xFCn edijilerini\u0148 birini ulanyp girip bilersi\u0148iz: {Available_oidc_providers_list}.",
  "identities.messages.4000029": "{expected} hemi\u015Felik bahasy bilen de\u0148 bolmaly",
