  "identities.messages.4000005": "\u041F\u0430\u0440\u043E\u043B\u044C \u043D\u0435 \u043C\u043E\u0436\u0435 \u0431\u0443\u0442\u0438 \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u0430\u043D\u0438\u0439 \u0447\u0435\u0440\u0435\u0437 {reason}.",
  "identities.messages.4000006": "\u041D\u0430\u0434\u0430\u043D\u0456 \u043E\u0431\u043B\u0456\u043A\u043E\u0432\u0456 \u0434\u0430\u043D\u0456 \u043D\u0435\u0434\u0456\u0439\u0441\u043D\u0456, \u043F\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435 \u043D\u0430\u044F\u0432\u043D\u0456\u0441\u0442\u044C \u043F\u043E\u043C\u0438\u043B\u043E\u043A \u0443 \u0432\u0430\u0448\u043E\u043C\u0443 \u043F\u0430\u0440\u043E\u043B\u0456 \u0430\u0431\u043E \u0456\u043C\u0435\u043D\u0456 \u043A\u043E\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430, \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u0456\u0439 \u0430\u0434\u0440\u0435\u0441\u0456 \u0430\u0431\u043E \u043D\u043E\u043C\u0435\u0440\u0456 \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u0443.",
  "identities.messages.4000007": "\u041E\u0431\u043B\u0456\u043A\u043E\u0432\u0438\u0439 \u0437\u0430\u043F\u0438\u0441 \u0437 \u0442\u0438\u043C \u0441\u0430\u043C\u0438\u043C \u0456\u0434\u0435\u043D\u0442\u0438\u0444\u0456\u043A\u0430\u0442\u043E\u0440\u043E\u043C (\u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u0430 \u043F\u043E\u0448\u0442\u0430, \u0442\u0435\u043B\u0435\u0444\u043E\u043D, \u0456\u043C'\u044F \u043A\u043E\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430, ...) \u0432\u0436\u0435 \u0456\u0441\u043D\u0443\u0454.",
  "identities.messages.4000008": "\u041D\u0430\u0434\u0430\u043D\u0438\u0439 \u043A\u043E\u0434 \u0430\u0432\u0442\u0435\u043D\u0442\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457 \u043D\u0435\u0434\u0456\u0439\u0441\u043D\u0438\u0439, \u0431\u0443\u0434\u044C \u043B\u0430\u0441\u043A\u0430, \u0441\u043F\u0440\u043E\u0431\u0443\u0439\u0442\u0435 \u0449\u0435 \u0440\u0430\u0437.",
  "identities.messages.4000009": "\u041D\u0435 \u0432\u0434\u0430\u043B\u043E\u0441\u044F \u0437\u043D\u0430\u0439\u0442\u0438 \u0436\u043E\u0434\u043D\u0438\u0445 \u0456\u0434\u0435\u043D\u0442\u0438\u0444\u0456\u043A\u0430\u0442\u043E\u0440\u0456\u0432 \u0432\u0445\u043E\u0434\u0443. \u0412\u0438 \u0437\u0430\u0431\u0443\u043B\u0438 \u0432\u0441\u0442\u0430\u043D\u043E\u0432\u0438\u0442\u0438 \u0457\u0445? \u0426\u0435 \u0442\u0430\u043A\u043E\u0436 \u043C\u043E\u0436\u0435 \u0431\u0443\u0442\u0438 \u0432\u0438\u043A\u043B\u0438\u043A\u0430\u043D\u043E \u043D\u0435\u043F\u0440\u0430\u0432\u0438\u043B\u044C\u043D\u0438\u043C \u043D\u0430\u043B\u0430\u0448\u0442\u0443\u0432\u0430\u043D\u043D\u044F\u043C \u0441\u0435\u0440\u0432\u0435\u0440\u0430.",
  "identities.messages.4000010": "\u041E\u0431\u043B\u0456\u043A\u043E\u0432\u0438\u0439 \u0437\u0430\u043F\u0438\u0441 \u0449\u0435 \u043D\u0435 \u0430\u043A\u0442\u0438\u0432\u043E\u0432\u0430\u043D\u0438\u0439. \u0412\u0438 \u0437\u0430\u0431\u0443\u043B\u0438 \u043F\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u0438 \u0441\u0432\u043E\u044E \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u0443 \u0430\u0434\u0440\u0435\u0441\u0443?",
  "identities.messages.4000011": "\u0423 \u0432\u0430\u0441 \u043D\u0435\u043C\u0430\u0454 \u043D\u0430\u043B\u0430\u0448\u0442\u043E\u0432\u0430\u043D\u043E\u0433\u043E \u043F\u0440\u0438\u0441\u0442\u0440\u043E\u044E TOTP.",
