  "identities.messages.4000030": "ki\u1EC3m tra h\u1EB1ng s\u1ED1 th\u1EA5t b\u1EA1i",
  "identities.messages.4000031": "M\u1EADt kh\u1EA9u kh\xF4ng th\u1EC3 s\u1EED d\u1EE5ng v\xEC n\xF3 qu\xE1 gi\u1ED1ng v\u1EDBi th\xF4ng tin nh\u1EADn d\u1EA1ng.",
